INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(2, 2019, '', 'A cidade medieval é, antes de mais nada, uma sociedade da abundância, concentrada num pequeno espaço em meio a vastas regiões pouco povoadas. Em seguida, é um lugar de produção e de trocas, onde se articulam o artesanato e o comércio, sustentados por uma economia monetária. É também o centro de um sistema de valores particular, do qual emerge a prática laboriosa e criativa do trabalho, o gosto pelo negócio e pelo dinheiro, a inclinação para o luxo, o senso da beleza. É ainda um sistema de organização de um espaço fechado com muralhas, onde se penetra por portas e se caminha por ruas e praças e que é guarnecido por torres. LE GOFF, J.; SCHMITT, J.-C. Dicionário temático do Ocidente Medieval. Bauru: Edusc, 2006.\r\n\r\n\r\n', 'No texto, o espaço descrito se caracteriza pela associação entre a ampliação das atividades urbanas e a', 'emancipação do poder hegemônico da realeza.', 'aceitação das práticas usurárias dos religiosos.', 'independência da produção alimentar dos campos.', 'superação do ordenamento corporativo dos ofícios.', 'permanência dos elementos arquitetônicos de proteção.', 'E', '', 1, 18, 1, NULL, 1),
(3, 2018, '', 'A existência em Jerusalém de um hospital voltado para o alojamento e o cuidado dos peregrinos, assim como daqueles entre eles que estavam cansados ou doentes, fortaleceu o elo entre a obra de assistência e de caridade e a Terra Santa. Ao fazer, em 1113, do Hospital de Jerusalém um estabelecimento central da ordem, Pascoal II estimulava a filiação dos hospitalários do Ocidente a ele, sobretudo daqueles que estavam ligados à peregrinação na Terra Santa ou em outro lugar. A militarização do Hospital de Jerusalém não diminuiu a vocação caritativa primitiva, mas a fortaleceu. DEMURGER, A. Os Cavaleiros de Cristo. Rio de Janeiro:\r\n', 'O acontecimento descrito vincula-se ao fenômeno ocidental do(a)', 'surgimento do monasticismo guerreiro, ocasionado pelas cruzadas.', 'descentralização do poder eclesiástico, produzida pelo feudalismo.', 'alastramento da peste bubônica, provocado pela expansão comercial. ', 'afirmação da fraternidade mendicante, estimulada pela reforma espiritual', 'criação das faculdades de medicina, promovida pelo renascimento urbano', 'A', '', 1, 18, 1, NULL, 1),
(4, 2018, '', 'Então disse: “Este é o local onde construirei. Tudo pode chegar aqui pelo Eufrates, o Tigre e uma rede de canais. Só um lugar como este sustentará o exército e a população geral”. Assim ele traçou e destinou as verbas para a sua construção, e deitou o primeiro tijolo com sua própria mão, dizendo: “Em nome de Deus, e em louvor a Ele. Construí, e que Deus vos abençoe”. AlLTBARI, M. Uma história dos povos árabes. São Paulo: Cia. das Letras, 1995 (adaptado).\r\n\r\n', 'A decisão do califa Al-Masur (754 – 775) de construir Bagdá nesse local orientou-se pela:', 'disponibilidade de rotas e terras férteis como base da dominação política.', 'proximidade das áreas populosas como afirmação da superfluidade bélica', 'submissão à hierarquia e à lei islâmica como controle do poder real.', 'fuga da península arábica como afastamento dos conflitos sucessórios', 'ocupação de região fronteiriça como contenção do avanço mongol.', 'A', '', 1, 18, 1, NULL, 1),
(5, 2017, '', 'Mas era sobretudo a lã que os compradores, vindos de Flandres ou da Itália procuravam por toda a parte. Para satisfazê-los, as raças foram melhoradas através do aumento progressivo das suas dimensões. Esse crescimento prosseguiu durante todo o século XIII, e as abadias da Ordem de Cister, onde eram utilizados os métodos mais racionais de criação de gado, desempenharam certamente um papel determinante nesse aperfeiçoamento. DUBY, G. Economia rural e vida no campo no Ocidente medieval.\r\n', '  O texto aponta para a relação entre aperfeiçoamento da atividade pastoril e avanço técnico na Europa ocidental feudal, que resultou do(a)', 'crescimento do trabalho escravo.', 'desenvolvimento da vida urbana.', 'padronização dos impostos locais.', 'uniformização do processo produtivo.', 'desconcentração da estrutura fundiária.', 'B', '', 1, 18, 1, NULL, 1),
(6, 2015, '', 'A casa de Deus, que acreditam una, está, portanto, dividida em três: uns oram, outros combatem, outros, enfim, trabalham. Essas três parte que coexistem, não suportam ser separadas; os serviços prestados por uma são a condição das obras das outras duas; cada uma por sua vez encarrega-se de aliviar o conjunto... Assim a lei pode triunfar e o mundo gozar da paz. ALDALBERON DE LAON. In: SPINOSA, F. Antologia de textos históricos medievais. Lisboa: Sá da Costa, 1981.\r\n', ' A ideologia apresentada por Aldalberon de Laon foi produzida durante a Idade Média. Um objetivo de tal ideologia e um processo que a ela se opôs estão indicados, respectivamente, em:', 'Justificação a dominação estamental revoltas camponesas.', 'Subverter a hierarquia social centralização monárquica.', 'Impedir a igualdade jurídica revoluções burguesas.', 'Controlar a exploração econômica unificação monetária', 'Questionar a ordem divina Reforma Católica', 'A', '', 1, 18, 1, NULL, 1),
(8, 2015, '', 'No início foram as cidades. O intelectual da Idade Média — no Ocidente — nasceu com elas. Foi com o desenvolvimento urbano ligado às funções comercial e industrial — digamos modestamente artesanal — que ele apareceu, como um desses homens de ofício que se instalavam nas cidades nas quais se impôs a divisão do trabalho. Um homem cujo ofício é escrever ou ensinar, e de preferência as duas coisas a um só tempo, um homem que, profissionalmente, tem uma atividade de professor e erudito, em resumo, um intelectual – esse homem só aparecerá com as cidades. LE GOFF, J. Os intelectuais na Idade Média. Rio de Janeiro: José Olympio, 2010.\r\n \r\n', 'O surgimento da categoria mencionada no período em destaque no texto evidencia o(a)', 'apoio dado pela Igreja ao trabalho abstrato.', 'relação entre desenvolvimento urbano e divisão do trabalho.', 'importância organizacional das corporações de ofício.', 'progressiva expansão da educação escolar.', 'acúmulo de trabalho dos professores e eruditos.', 'B', '', 1, 18, 1, NULL, 1),
(9, 2014, '', 'Sou uma pobre e velha mulher,\r\nMuito ignorante, que nem sabe ler.\r\nMostraram-me na igreja da minha terra\r\nUm Paraíso com harpas pintado\r\nE o Inferno onde fervem almas danadas,\r\nUm enche-me de júbilo, o outro me aterra.\r\nVILLON, F. In: GOMBRICH, E. História da arte. Lisboa: LTC, 1999.\r\n\r\n', 'Os versos do poeta francês François Villon fazem referência às imagens presentes nos templos católicos medievais. Nesse contexto, as imagens eram usadas com o objetivo de', 'refinar o gosto dos cristãos', 'incorporar ideais heréticos.', 'educar os fiéis através do olhar', 'divulgar a genialidade dos artistas católicos.', 'valorizar esteticamente os templos religiosos.', 'C', '', 1, 18, 1, NULL, 1),
(10, 2014, '', 'Todo homem de bom juízo, depois que tiver realizado sua viagem, reconhecerá que é um milagre manifesto ter podido escapar de todos os perigos que se apresentam em sua peregrinação; tanto mais que há tantos outros acidentes que diariamente podem aí ocorrer que seria coisa pavorosa àqueles que aí navegam querer pô-los todos diante dos olhos quando querem empreender suas viagens. J. P. T. Histoire de plusieurs voyages aventureux. 1600. In: DELUMEAU, J. História do medo no Ocidente: 1300-1800. São Paulo: Cia. das Letras, 2009 (adaptado).\r\n \r\n', 'Esse relato, associado ao imaginário das viagens marítimas da época moderna, expressa um sentimento de', 'gosto pela aventura.', 'fascínio pelo fantástico.', 'temor do desconhecido.', 'interesse pela natureza.', 'purgação dos pecados.', 'C', '', 1, 18, 1, NULL, 1),
(11, 2013, '', 'Quando ninguém duvida da existência de um outro mundo, a morte é uma passagem que deve ser celebrada entre parentes e vizinhos. O homem da Idade Média tem a convicção de não desaparecer completamente, esperando a ressurreição. Pois nada se detém e tudo continua na eternidade. A perda contemporânea do sentimento religioso fez da morte uma provação aterrorizante, um trampolim para as trevas e o desconhecido. DUBY, G. Ano 1000 ano 2000 na pista dos nossos medos. São Paulo: Unesp, 1998 (adaptado).\r\n \r\n', 'Ao comparar as maneiras com que as sociedades têm lidado com a morte, o autor considera que houve um processo de', 'mercantilização das crenças religiosas.', 'transformação das representações sociais.', 'disseminação do ateísmo nos países de maioria cristã.', 'diminuição da distância entre saber científico e eclesiástico.', 'amadurecimento da consciência ligada à civilização moderna', 'B', '', 1, 18, 1, NULL, 1),
(12, 2009, '', 'A Idade Média é um extenso período da História do Ocidente cuja memória é construída e reconstruída segundo as circunstâncias das épocas posteriores. Assim, desde o Renascimento, esse período vem sendo alvo de diversas interpretações que dizem mais sobre o contexto histórico em que são produzidas do que propriamente sobre o Medievo.\r\n', '  Um exemplo acerca do que está exposto no texto acima é', 'a associação que Hitler estabeleceu entre o III Reich e o Sacro Império Romano Germânico.', 'o retorno dos valores cristãos medievais, presentes nos documentos do Concílio Vaticano II.', 'a luta dos negros sul-africanos contra o apartheid inspirada por valores dos primeiros cristãos.', 'o fortalecimento político de Napoleão Bonaparte, que se justificava na amplitude de poderes que tivera Carlos Magno.', 'a tradição heroica da cavalaria medieval, que foi afetada negativamente pelas produções cinematográficas de Hollywood.', 'A', '', 1, 18, 1, NULL, 1),
(13, 2020, '', 'O surgimento das primeiras universidades, nos séculos XII e XIII, marca um momento capital da história do Ocidente medieval. Em relação à época anterior, esse momento comportou elementos de continuidade e de ruptura. Os primeiros devem ser buscados na localização urbana das universidades, no conteúdo dos ensinamentos, no papel social dos homens de saber. Já os elementos de ruptura foram inicialmente de ordem institucional. No âmbito das instituições educativas, este sistema era novo e original. As comunidades autônomas dos mestres e dos estudantes eram protegidas pelas mais altas autoridades leigas e religiosas daquele tempo, permitindo tanto progressos no domínio dos métodos intelectuais e em sua difusão como uma inserção mais eficiente das pessoas de saber na sociedade da época. (Adaptado de J. Verger, Cultura, ensino e sociedade no ocidente nos séculos XII e XIII. Bauru: EDUSC, 2001, p.189-190.)\r\n\r\n', 'Considerando o texto e seus conhecimentos sobre o período medieval, assinale a alternativa correta.', 'A Igreja Católica apoiava a estruturação das universidades medievais, que representavam o avanço das ciências e a superação de dogmas e das teorias teocêntricas.', 'A organização institucional diferencia as universidades medievais das corporações de ofícios, visto que seu método de estudo estava calcado na escolástica, caracterizando o atraso do mundo medieval.', 'Uma ruptura trazida pelas universidades medievais foi o início da atuação dos copistas nas bibliotecas, que copiavam sistematicamente a produção de autores latinos críticos aos dogmas religiosos.', 'A institucionalização das universidades medievais era um dado novo no período; essas instituições se caracterizavam pelo apoio das autoridades de dentro e de fora da Igreja, e pela maior autonomia e inserção social de seus membros.', '', 'D', '', 2, 18, 1, NULL, 1),
(14, 2019, '', 'Os estudiosos muçulmanos adaptaram a herança recebida dos povos arabizados. Entre os domínios conquistados pelos muçulmanos estavam a Mesopotâmia e o antigo Egito, civilizações que desde cedo observaram os fenômenos astronômicos. O estudo dos fenômenos naturais no Crescente Fértil possibilitou a agricultura e perdurou por milênios. Nas costas do Mar Egeu, na região da Jônia, surgiram no século VI a.C. as primeiras explicações dos fenômenos naturais desvinculadas dos desígnios divinos. E as conquistas de Alexandre permitiram o início do intercâmbio entre o conhecimento grego, de um lado, e o dos antigos impérios egípcio, babilônico e persa, de outro. Além disso, houve trocas científicas e culturais com os indianos. O império árabe-islâmico foi, a partir do século VII, o herdeiro desse legado científico multicultural, ao qual os estudiosos muçulmanos deram seus aportes ao longo da Idade Média. (Adaptado de Beatriz Bissio, O mundo falava árabe. Rio de Janeiro: Civilização Brasileira, 2012, p. 200- 201.)\r\n\r\n', 'Considerando o texto acima sobre o Islã Medieval e seus conhecimentos, assinale a alternativa correta.', 'A extensão do território sob domínio islâmico e a liberdade religiosa e cultural implementada nessas áreas aceleraram a construção de novos conhecimentos pautados na cosmologia ocidental.', 'A partir do século VII, o avanço dos exércitos islâmicos garantiu a expansão do império de forma ditatorial sobre antigos núcleos culturais da Índia até as terras gregas do Império Bizantino, chegando à Espanha.', 'Os conhecimentos sobre os fenômenos naturais construídos pelos mesopotâmicos, egípcios, macedônicos, babilônicos, persas, entre outros povos, foram ignorados pelo Islã Medieval, marcado pelo fundamentalismo religioso.', 'A difusão de saberes multiculturais foi uma das marcas do Império árabe-islâmico, sendo ele a via de transmissão do sistema numérico indiano para o Ocidente e de obras da filosofia greco-romana para o Oriente.', '', 'D', '', 2, 18, 1, NULL, 1),
(15, 2018, '', 'Estamos acostumados a considerar que o sistema centro/periferia, ao menos no Ocidente, é um eixo essencial da estrutura e do funcionamento no espaço das economias, das sociedades, das civilizações. O historiador Fernand Braudel estimou que tal sistema só existiu e funcionou plenamente a partir do século XV. Essa definição não se aplica à Cristandade Medieval sem importantes correções. A noção de centro e a oposição centro/periferia são menos decisivas que outros sistemas de orientação espacial. O principal sistema é o que opõe o baixo ao alto, quer dizer, o Aqui, esse “mundo” imperfeito e marcado pelo Pecado Original, ao céu, morada de Deus. (Adaptado de Jacques Le Goff e Jean-Claude Schmitt, “Centro/Periferia”, em Dicionário temático do ocidente medieval, v. 2. São Paulo: Edusc, 2002, p. 203.)\r\n \r\n', 'A partir do texto acima, assinale a alternativa correta.', 'Usada nas Ciências Humanas para a compreensão de períodos históricos desde a Antiguidade, a noção de centro/periferia perdura até a atualidade e estrutura o sistema econômico global contemporâneo.', 'As noções de baixo e alto têm um sentido histórico mais preciso para a compreensão da Cristandade Medieval do que o sistema centro/periferia.', 'O sistema centro/periferia é aplicável ao estudo da Cristandade Medieval, já que os feudos constituíam o centro da vida econômica e cultural naquele contexto.', 'O sistema centro/periferia aplicado durante a Era Medieval espelhava o sistema de orientação baixo e alto, sendo o baixo o mundo do pecado e o alto o mundo da virtude cristã.', '', 'B', '', 2, 18, 1, NULL, 1),
(16, 2016, '', 'Reproduz-se, abaixo, trecho de um sermão do bispo Cesário de Arles (470-542), dirigido a uma paróquia rural.\r\n\r\n“Vede, irmãos, como quem recorre a Igreja em sua doença obtém a saúde do corpo e a remissão dos pecados. Se é possível, pois, encontrar este duplo beneficio na Igreja, por que ha infelizes que se empenham em causar mal a si mesmos, procurando os mais variados sortilégios: recorrendo a encantadores, a feitiçarias em fontes e árvores, amuletos, charlatães, videntes e adivinhos?”\r\n\r\n(Fonte: http://www.institutosapientia.com.br/site/index.php*option=co content&view=articIe&id=1397:sao-cesario-de-arIes-sermao-13- para-uma-paroquia-rural&catid=28: outros-artigos&Itemid=285 )\r\n', ' A partir desse sermão, escrito no sul da atual Franca, é correto afirmar que:', 'A Igreja Católica assumia funções espirituais e deixava a nobreza o cuidado da saúde dos camponeses, através de ordens religiosas e militares.', 'O cristianismo tinha penetrado em todas as categorias sociais e era interpretado da mesma forma através da autoridade dos bispos.', 'Praticas consideradas menos ortodoxas por Cesário de Arles ainda encontravam espaço em setores da sociedade e a elite da Igreja tentava se afirmar como o único acesso ao sagrado.', 'O avanço do materialismo estava afastando da Igreja os camponeses, que, com isto, deixavam de pagar os dízimos eclesiásticos.', '', 'C', '', 2, 18, 1, NULL, 1),
(17, 2015, '', 'São mais ou menos constantes as queixas dos bispos e dos clérigos sobre a manutenção das práticas pagãs no mínimo até o século X. Um conjunto de práticas pagãs se mantém quase intacto, sem levar em conta festas públicas pagãs como a de 1º de janeiro, que sobreviveu durante muito tempo. (Adaptado de Michel Rouche, \'Alta Idade Média Ocidental\', em Paul Veyne (org.), História da vida privada: do Império Romano ao ano mil. São Paulo: Companhia das Letras, 2009, p.504.)\r\n', 'Assinale a alternativa correta.', 'A crítica à institucionalização da Igreja, com a consolidação da hierarquia em torno do papa e dos bispos, teve sua principal manifestação na manutenção de práticas pagãs.', 'As práticas pagãs eram costumes de origem popular respeitados pelas ordens religiosas, como os beneditinos, mas criticados pelos bispos e pelo clero tradicional.', 'A diversidade de práticas religiosas era frequente na Alta Idade Média, apesar dos esforços institucionais do alto clero católico em combater as crenças populares e defender a unidade religiosa na Europa.', 'A presença do cristianismo não significou o desaparecimento de todas as práticas religiosas consideradas pagãs, pois algumas delas foram toleradas pela Igreja, como o sabá e as festas populares.', '', 'C', '', 2, 18, 1, NULL, 1),
(18, 2012, '', 'A longa presença de povos árabes no norte da África, mesmo antes de Maomé, possibilitou uma interação cultural, um conhecimento das línguas e costumes, o que facilitou posteriormente a expansão do islamismo. Por outro lado, deve-se considerar a superioridade bélica de alguns povos africanos, como os sudaneses, que efetivaram a conversão e a conquista de vários grupos na região da Núbia, promovendo uma expansão do Islã que não se apoia na presença árabe. (Adaptado de Luiz Arnaut e Ana Mônica Lopes, História da África: uma introdução. Belo Horizonte: Crisálida, 2005, p. 29-30.)\r\n', 'Sobre a presença islâmica na África é correto afirmar que:', 'O princípio religioso do esforço de conversão, a jihad, foi marcado pela violência no norte da África e pela aceitação do islamismo em todo o continente africano.', 'Os processos de interação cultural entre árabes e africanos, como os propiciados pelas relações comerciais, são anteriores ao surgimento do islamismo.', 'A expansão do islamismo na África ocorreu pela ação dos árabes, suprimindo as crenças religiosas tradicionais do continente.', 'O islamismo é a principal religião dos povos africanos e sua expansão ocorreu durante a corrida imperialista do século XIX', '', 'B', '', 2, 18, 1, NULL, 1),
(20, 2018, '', 'A ideia de que a demanda de especiarias resultava da necessidade de disfarçar o gosto da carne e do peixe putrefatos é um dos grandes mitos da história da alimentação. Na Europa medieval, os alimentos frescos eram mais frescos que os atuais, pois provinham da produção local. Os alimentos em conserva mantinham se em salga, curtição, dessecação ou gordura, assim como hoje em dia são enlatados, refrigerado, liofilizado ou embalado a vácuo. De qualquer forma, os aspectos determinantes do papel desempenhado pelas especiarias na gastronomia eram o gosto e a cultura. A cozinha muito temperada com especiarias era objeto de desejo por ser cara e por “condimentar” a posição social dos ricos e as aspirações de quem ambicionava sê-lo. Além disso, a moda gastronômica predominante na baixa Idade Média europeia imitava as receitas árabes, que exigiam sabores doces e ingredientes fragrantes: leite de amêndoa, extratos de flores aromáticas e outras iguarias orientais. (Adaptado de Felipe Armesto-Fernández, 1492: o ano em que o mundo começou. São Paulo: Companhia das Letras, 2017, p.27).\r\n', 'A partir do texto acima e de seus conhecimentos históricos:', 'defina o que são as especiarias e explique seu significado social na Europa medieval.', 'explique como era feito o comércio de especiarias na baixa Idade Média.', '', 'Era esperado que os candidatos identificassem as especiarias como temperos ou condimentos usados pelos europeus para acrescentar sabor e aroma aos alimentos (por exemplo: cravo, canela, gengibre, pimenta-do-reino, noz-moscada, baunilha, entre outros ). Por serem caras, eram usadas naquele contexto histórico como um elemento de distinção, de status e de e de diferenciação de poder entre grupos sociais.', 'Era esperado que o candidato diferenciasse as práticas comerciais da baixa Idade Média e m relação à Era Moderna. Almejava-se a identificação dos contextos históricos e suas relações. O comércio das especiarias na baixa Idade Média era feito por vias terrestres e marítimas. Por via terrestre, os produtos eram transportados em rotas específicas (por exemplo, a Rota da Seda) da Ásia Central até o Mediterrâneo. A partir do Mediterrâneo, eram distribuídas por mar, por terra ou por ambas as vias para as feiras e outros centros comerciais espalhados na Europa.', '', '', 3, 18, 2, NULL, 1),
(21, 2015, '', '\'Guerreiros a pé e cavaleiros fizeram um caminho através dos cadáveres. Mas tudo isso ainda era pouca coisa. Fomos ao Templo de Salomão, onde os sarracenos tinham o costume de celebrar seus cultos. O que se passou nestes lugares? Se dissermos a verdade, ultrapassaremos o limite do que é possível crer. Será suficiente dizer que, no Templo e no pórtico de Salomão, cavalgava-se em sangue até os joelhos dos cavaleiros e até o arreio dos cavalos. Justo e admirável julgamento de Deus, que quis que este lugar recebesse o sangue daqueles que blasfemaram contra Ele durante tanto tempo.\' (Raymond d’Aguiller, Historia Francorum qui ceperunt Jerusalem. http://www.fordham.edu/halsall/source/raymond-cde.asp#jerusalem2. Acessado em 01/10/2014.) ', 'O texto acima se refere à Primeira Cruzada (1096-1099). Responda às questões abaixo.', 'Identifique um motivo econômico e um motivo político para o movimento das Cruzadas.', 'Que grupo social liderou esse movimento e como o cronista citado identifica o apoio de Deus ao empreendimento cruzadístico?', '', 'As Cruzadas tiveram múltiplas motivações. A questão solicitava a identificação de motivações econômicas e políticas. Entre as econômicas, poderiam ser mencionadas: a conquista de territórios, a abertura de rotas comerciais em direção ao Oriente e a realização de saques. Como motivações políticas, podiam ser citadas: a tentativa de fortalecimento do papado diante do Império Bizantino e do Cristianismo Ortodoxo; o estabelecimento do antagonismo religioso dos cristãos em relação ao poder islâmico; e as questões relacionadas à expansão demográfica, que demandava novos domínios territoriais.', 'O grupo social que liderou o movimento foi a nobreza e, pelo relato do cronista, depreende-se que havia o entendimento de que a vontade divina estaria sendo cumprida pela aplicação de castigos, punições e vingança contra os que teriam invadido os lugares considerados sagrados pelos cristãos e blasfemado contra sua fé.', '', '', 3, 18, 2, NULL, 1),
(22, 2014, '', 'No Natal de 800, o papa Leão III coroou Carlos Magno como Imperador dos Romanos. O Imperador recebeu o antigo título de Augusto.', '', 'Caracterize a autoridade de Carlos Magno como Imperador naquele momento.', 'Apresente dois aspectos do renascimento carolíngio', '', 'A coroação de Carlos Magno pelo Papa Leão III caracterizava o Imperador como detentor dos poderes religioso e militar, cujos alcances se estendiam por praticamente toda a Europa, conferindo-lhe um poder superior ao dos demais monarcas do período.', 'O Renascimento Carolíngio pode ser caracterizado pela produção artística e cultural que remete a elementos greco-romanos, germânicos e cristãos; pela criação de escolas em mosteiros, catedrais e palácios; pela valorização dos estudos clássicos como parte do dever religioso que Carlos Magno se atribuía como defensor da fé cristã.', '', '', 3, 18, 2, NULL, 1),
(23, 2013, '', 'Tradicionalmente, a vitória dos cristãos sobre os muçulmanos na Batalha de Covadonga, na região da Península Ibérica, em 722, foi considerada o início da chamada Reconquista. Mais do que um decisivo confronto bélico, Covadonga foi uma luta dos habitantes locais por sua autonomia. A aproximação ideológica desta vitória, feita mais tarde por clérigos das Astúrias, conferiu à batalha a importância de um fato transcendente, associado ao que se considerava a missão da monarquia numa Hispânia que tombara diante dos seus inimigos.\r\n(Adaptado de R. Ramos, B. V. Sousa e N. Monteiro (orgs.), História de Portugal. Lisboa: A Esfera dos Livros, 2009, p. 17-18.)', '', 'Explique o que foi a Reconquista.', 'De que maneiras a Batalha de Covadonga foi reutilizada no discurso histórico e político pelos clérigos das Astúrias?', '', 'Esperava-se que candidato explicasse a Reconquista em seus aspectos gerais, identificando-a como um processo bélico empreendido pelos cristãos contra os muçulmanos, na Península Ibérica. As disputas militares iniciaram-se no século VIII e estenderam-se até 1492, quando ocorreu a tomada de Granada pelo reino da Espanha.', 'O vestibulando deveria identificar a apropriação do discurso histórico como um elemento ideológico e um fato transcendente, que legitimava o poder monárquico, a partir de uma suposta missão cumprida pela monarquia cristã diante dos árabes muçulmanos na Península Ibérica.', '', '', 3, 18, 2, NULL, 1),
(24, 2012, '', 'Godrici de Finchale foi um mercador que viveu no século XI, na Baixa Idade Média, no leste da atual Inglaterra. \'Quando o rapaz, depois de ter passado os anos da infância sossegadamente em casa, chegou à idade varonil, principiou a aprender com cuidado e persistência o que ensina a experiência do mundo. Para isso decidiu não seguir a vida de lavrador, mas estudar, aprender e exercer os rudimentos de concepções mais sutis. Por esta razão, aspirando à profissão de mercador, começou a seguir o modo de vida do vendedor ambulante, aprendendo primeiro como ganhar em pequenos negócios e coisas de preço insignificante; e, então, sendo ainda um jovem, o seu espírito ousou pouco a pouco comprar, vender e ganhar com coisas de maior preço.\' (Adaptado de Reginald of Durnham, \'Libellus de Vita et Miraculis S. Godrici\', em Fernando Espinosa, Antologia de textos históricos medievais. 3ª ed., Lisboa: Sá da Costa Editora, 1981, p. 198.)', '', 'Segundo o texto, o ofício de mercador exigia uma preparação diferente daquela do lavrador. Quais eram as diferenças entre esses dois ofícios? ', 'Cite duas características do renascimento comercial e urbano ocorrido no final do período medieval.', '', 'O candidato deveria identificar as diferenças entre o lavrador e o mercador. De acordo com o texto, para exercer o ofício de mercador era necessário adquirir algum tipo de instrução, como saber calcular. Precisava ainda dominar habilidades como a de estabelecer relações de comércio. O lavrador, por sua vez, ficava preso à terra e vivia como servo. ', 'Entre as características do renascimento cultural e urbano estão: o fortalecimento dos burgos e o surgimento de um novo grupo social, a burguesia; o incremento das relações comerciais entre feudos e cidades; o surgimento de feiras, casas bancárias e corporações de ofício e a retomada do comércio de especiarias com o Oriente.', '', '', 3, 18, 2, NULL, 1),
(25, 2011, '', 'No início do século XIV, o inquisidor Bernardo Guy escreveu um Manual do Inquisidor, no qual descrevia como se ingressava na seita herética que ficou conhecida pelo nome de pseudoapóstolos: “Perante algum altar, na presença de membros da seita, o candidato se despe de suas roupas, como sinal de renúncia a tudo que possui, para seguir com perfeição a pobreza evangélica. Também se exige que ele prometa não obedecer a nenhum mortal, mas só a Deus, como se fosse um apóstolo sujeito apenas a Cristo e a ninguém mais.” (Adaptado de Nachman Falbel, Heresias medievais. São Paulo: Perspectiva, 1977, p. 66.) ', '', 'Por quais razões essa heresia era uma ameaça para a Igreja do período? ', 'Caracterize a relação entre o poder religioso e o poder temporal na baixa Idade Média.', '', 'A heresia mencionada no texto poderia ser considerada uma ameaça ao poder da Igreja porque pregava a pobreza, enquanto a Igreja acumulava uma grande riqueza; e porque recusava a obediência ao papa e a toda a hierarquia eclesiástica. ', 'A relação entre o poder religioso e o poder temporal na baixa Idade Média pode ser caracterizada a partir de diferentes situações históricas. Por um lado, a Igreja legitimava a estratificação social, justificando a existência das três ordens (trabalhadores, guerreiros e clero) nas quais se dividia a sociedade; a Igreja também legitimava o poder político, na medida em que ungia os reis; além disso, a própria Igreja exercia o poder temporal, já que era uma grande senhora feudal; o poder temporal, o chamado “braço secular”, era quem punia os hereges que a Igreja perseguia por meio da Inquisição. Por outro lado, essa relação também se caracterizava pelo conflito entre os dois poderes, como se viu na Querela das Investiduras e na existência de dois papas simultâneos durante o cisma de Avignon. Poderia ser mencionado também que, naquele momento, o início da centralização monárquica enfraquecia o poder da Igreja.', '', '', 3, 18, 2, NULL, 1),
(32, 2019, NULL, 'Os viajantes, missionários, administradores coloniais e etnógrafos europeus, no passado, tenderam a fundir múltiplas identidades em um único conceito de tribo. O uso da palavra tribo para descrever as sociedades africanas surgiu de um desejo de enaltecer o Estado-nação, ao mesmo tempo em que sugeria a inferioridade inerente de outros. Em resumo, conotava políticas primitivas que eram menos desenvolvidas do que as políticas dos Estados-nação. (Adaptado de John Parker e Richard Rathbone, “A ideia de África”, em História da África. Lisboa: Quimera, 2016, p. 56- 58.)', 'Baseado no texto acima e em seus conhecimentos, assinale a alternativa correta.', 'A formação e a difusão do conceito de tribo no pensamento europeu acompanharam os avanços do colonialismo na África no século XIX, legitimando o domínio de seus povos por agentes oriundos de nações que se consideravam civilizadas e superiores.', 'O conceito de tribo ganhou força no pensamento ocidental, porque na África não havia formações políticas que cobriam grandes extensões territoriais como na Europa. Ou seja, os europeus não encontraram estruturas políticas acima das unidades tribais.', 'As sociedades africanas eram organizadas a partir de pequenas tribos lideradas por chefes guerreiros, o que gerava fragmentação política e guerras, inviabilizando nesse continente a formação de unidades políticas complexas nos moldes europeus.', 'Em razão das tradições milenares e do respeito aos ancestrais, as tribos eram unidades sociais e políticas estáticas assentadas em uma identidade homogênea. Os europeus comumente desrespeitavam todas essas características na colonização.', '', 'A', '', 2, 20, 1, '', 1),
(33, 2017, NULL, 'Leia os versos iniciais do poema The White Man’s Burden (O fardo do homem branco).', 'O poema de Rudyard Kipling foi escrito em Londres, em 1898, após a estadia do autor nos EUA. Considerando-se o contexto do imperialismo do século XIX, o poeta expressa', 'a defesa do expansionismo norte-americano, justificado como um dever moral explicitado no título “The White Man’s Burden”.', 'o olhar caridoso em relação aos povos dominados no contexto do imperialismo do século XIX, como se observa no verso “half devil and half child”.', 'uma crítica à visão da superioridade branca vigente durante a corrida imperialista do século XIX, ao enaltecer as características “folk and wild”.', 'a visão de que as famílias americanas não devem ser punidas pela política expansionista dos EUA, como se observa na recomendação “Go send your sons to exile”', '', 'A', '', 2, 20, 1, 'Take up the White Man’s burden<br>Send forth the best ye breed -<br> Go send your sons to exile<br> To serve your captives` need<br> To wait in heavy harness<br> On fluttered folk and wild<br> Your new-caught, sullen peoples, Half devil and half child (...)<br> (Rudyard Kipling, Rudyard Kipling’s Verse. Disponível em http://kiplingsociety.co.uk/poems_burden.htm. Acessado em 17/10/2016.)', 1),
(34, 2013, NULL, '', 'As exposições universais do século XIX, sobretudo as de Londres e Paris, se caracterizavam', ' pelo louvor à superioridade europeia e pela apresentação otimista da técnica e da ciência.', 'pela crítica à expansão sobre a África, movimento considerado um freio ao progresso europeu.', 'pela crítica marxista aos princípios burgueses dominantes nos centros urbanos europeus.', 'pelo elogio das sociedades burguesas associadas às vanguardas da época, como o Cubismo, o Dadaísmo e o Surrealismo.', '', 'A', '', 2, 20, 1, '', 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(37, 2018, , 'O orientalismo é um estilo de pensamento baseado em uma distinção entre Oriente e Ocidente. Quando o orientalista culto viajava para o país de sua especialização, ia sempre acompanhado de máximas inabaláveis sobre a “civilização” que estudara; eram raros os orientalistas que tinham outro interesse que não o de provar poeirentas “verdades”, aplicando-as aos nativos que não os entendiam e, portanto, eram degenerados. O Oriente precisava primeiro ser conhecido, depois invadido e possuído, e então recriado por estudiosos. (Adaptado de Edward Said, Orientalismo. São Paulo: Companhia das Letras, 1990).', 'Considerando o texto e o quadro acima reproduzido e seus conhecimentos, responda às questões:', 'Segundo Edward Said, o que era o orientalismo?', 'Identifique um elemento do Orientalismo no quadro do pintor italiano Giulio Rosati (1858-1917) e explique esse elemento.', '', 'Essa alternativa tinha como objetivo estimular a reflexão dos candidatos sobre o conceito de orientalismo (descrito no texto apresentado). Era esperado que os candidatos identificassem que o orientalismo é uma lançada pelo Ocidente, pautada especialmente em um discurso de poder eurocêntrico que distinguia no Oriente elementos estereotipados e exóticos. No orientalismo, práticas culturais, artísticas, religiosas, sociais e políticas que se diferenciassem das europeias eram tidas como inferiores, abrindo espaço para que discursos de poder centrados na ideia da superioridade civilizacional europeia, que fortaleciam práticas como o colonialismo e o imperialismo.', 'Era esperado que o candidato utilizasse a imagem da questão como um documento histórico, operando a leitura dessa imagem junto ao conceito de imperialismo trabalhado na alternativa anterior. O candidato, portanto, deveria identificar um elemento orientalista na pintura (retratação do cenário de um harém ou aspectos do exotismo retratados na dança da mulher que tem seus seios expostos, entre outros), que reforçavam a premissa de que o Ocidente inventava um Oriente; sempre sedutor, exótico, letárgico, etc', '', NULL, 3, 20, 2, '', 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(39, 2015, , 'Os calendários são fontes históricas importantes, na medida em que expressam a concepção de tempo das sociedades. Essas imagens compõem um calendário medieval (1460-1475) e cada uma delas representa um mês, de janeiro a dezembro.', 'Com base na análise do calendário, apreende-se uma concepção de tempo:', 'cíclica, marcada pelo mito arcaico do eterno retorno.', 'humanista, identificada pelo controle das horas de atividade por parte do trabalhador', 'escatológica, associada a uma visão religiosa sobre o trabalho.', 'natural, expressa pelo trabalho realizado de acordo com as estações do ano.', 'romântica, definida por uma visão bucólica de sociedade.', 'D', '', 1, 18, 1, '', 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(40, 2011, , '', 'No quadro acima, observa-se a organização espacial do trabalho agrícola típica do período medieval. A partir dele, podemos afirmar que', 'os camponeses estão distantes do castelo porque já abandonavam o domínio senhorial, num momento em que práticas de conservação do solo, como a rotação de culturas, e a invenção de novos instrumentos, como o arado, aumentavam a produção agrícola.', 'os camponeses utilizavam, então, práticas de plantio direto, o que permitia a melhor conservação do solo e a fertilidade das terras que pertenciam a um senhor feudal, como sugere o castelo fortificado que domina a paisagem ao fundo do quadro.', 'um castelo fortificado domina a paisagem, ao fundo, pois os camponeses trabalhavam no domínio de um senhor; pode-se ver também que utilizavam práticas de rotação de culturas, visando à conservação do solo e à manutenção da fertilidade das terras.', 'A cena retrata um momento de mudança técnica e social: desenvolviam-se novos instrumentos agrícolas, como o arado, e o uso de práticas de plantio direto, o que levava ao aumento da produção, permitindo que os camponeses abandonassem o domínio senhorial.', '', 'C', '', 2, 18, 1, '', 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(41, 2018, '', 'O século XVIII é, por diversas razões, um século diferenciado. Razão e experimentação se aliavam no que se acreditava ser o verdadeiro caminho para o estabelecimento do conhecimento científico, por tanto tempo almejado. O fato, a análise e a indução passavam a ser parceiros fundamentais da razão. É ainda no século XVIII que o homem começa a tomar consciência de sua situação na história. ODALIA, N. In: PINSKY, J.; PINSKY, C. B. História da cidadania.', 'No ambiente cultural do Antigo Regime, a discussão filosófica mencionada no texto tinha como uma de suas características a', 'aproximação entre inovação e saberes antigos.', 'conciliação entre revelação e metafísica platônica.', 'vinculação entre escolástica e práticas de pesquisa.', 'separação entre teologia e fundamentalismo religioso.', 'contraposição entre clericalismo e liberdade de pensamento.', 'E', '', 1, 19, 1, '', 1),
(42, 2013, '', 'O estudo da Ilustração nunca mais foi o mesmo após o holocausto, durante a Segunda Guerra Mundial. A crença ingênua no poder regenerador da razão inviabilizou-se. Estilhaçou-se a cômoda certeza de que as Luzes foram a filosofia da burguesia triunfante, e dos quatro pontos da Europa surgiram evidências acerca da amplitude e variação do fenômeno, que não caberia mais considerar nem apenas burguês, nem eminentemente francês, nem restrito ao século XVIII. (Adaptado de Laura de Mello e Souza, em http://www.revistadehistoria.com.br/secao/artigos/as-paixoesintelectuais. Acessado em 20/08/2012.)', 'A partir do texto, é correto afirmar que:', 'A experiência do holocausto, no século XX, pode ser interpretada como a negação do projeto das Luzes, porque rejeita a eficácia do poder do Estado.', 'A compreensão das Luzes não se prende à explicação do triunfo da burguesia, exigindo um estudo mais amplo sobre seus impactos na Europa.', 'O projeto das Luzes difundia o ideário do progresso e, contraditoriamente, ensejava o conhecimento científico.', 'O ideário das Luzes ajuda a compreender as revoluções liberais dos séculos XVIII e XIX, que defendiam a intolerância religiosa.', '', 'B', '', 2, 19, 1, '', 1),
(43, 2013, '', '“O homem nasce livre, e por toda a parte encontra-se a ferros. O que se crê senhor dos demais não deixa de ser mais escravo do que eles. (...) A ordem social, porém, é um direito sagrado que serve de base a todos os outros. (...) Haverá sempre uma grande diferença entre subjugar uma multidão e reger uma sociedade. Sejam homens isolados, quantos possam ser submetidos sucessivamente a um só, e não verei nisso senão um senhor e escravos, de modo algum considerando-os um povo e seu chefe. Trata-se, caso se queira, de uma agregação, mas não de uma associação; nela não existe bem público, nem corpo político.” (Jean-Jacques Rousseau, Do Contrato Social. [1762]. São Paulo: Ed. Abril, 1973, p. 28,36.)', 'No trecho apresentado, o autor', 'argumenta que um corpo político existe quando os homens encontram-se associados em estado de igualdade política.', 'reconhece os direitos sagrados como base para os direitos políticos e sociais.', 'defende a necessidade de os homens se unirem em agregações, em busca de seus direitos políticos.', 'denuncia a prática da escravidão nas Américas, que obrigava multidões de homens a se submeterem a um único senhor.', '', 'A', '', 2, 19, 1, '', 1),
(44, 2012, '', '“O homem nasce livre, e por toda a parte encontra-se a ferros. O que se crê senhor dos demais não deixa de ser mais escravo do que eles. (...) A ordem social, porém, é um direito sagrado que serve de base a todos os outros. (...) Haverá sempre uma grande diferença entre subjugar uma multidão e reger uma sociedade. Sejam homens isolados, quantos possam ser submetidos sucessivamente a um só, e não verei nisso senão um senhor e escravos, de modo algum considerando-os um povo e seu chefe. Trata-se, caso se queira, de uma agregação, mas não de uma associação; nela não existe bem público, nem corpo político.” (Jean-Jacques Rousseau, Do Contrato Social. [1762]. São Paulo: Ed. Abril, 1973, p. 28,36.)', ' Sobre Do Contrato Social, publicado em 1762, e seu autor, é correto afirmar que:', 'Rousseau, um dos grandes autores do Iluminismo, defende a necessidade de o Estado francês substituir os impostos por contratos comerciais com os cidadãos.', 'A obra inspirou os ideais da Revolução Francesa, ao explicar o nascimento da sociedade pelo contrato social e pregar a soberania do povo.', 'Rousseau defendia a necessidade de o homem voltar a seu estado natural, para assim garantir a sobrevivência da sociedade.', 'O livro, inspirado pelos acontecimentos da Independência Americana, chegou a ser proibido e queimado em solo francês.', '', 'B', '', 2, 19, 1, '', 1),
(45, 2011, '', 'Na segunda metade do século XVIII, pensadores importantes, como Denis Diderot, atacaram os próprios fundamentos do imperialismo. Para esse filósofo, os seres humanos eram fundamentalmente formados pelas suas culturas e marcados pelas diferenças culturais, não existindo o homem no estado de natureza. Isso levava à ideia de relatividade cultural, segundo a qual os povos não podiam ser considerados superiores ou inferiores a partir de uma escala universal de valores. (Adaptado de Sankar Muthu, Enlightenment Against Empire. Princeton: Princeton University Press, 2003, p. 258, 268.)', '', ' Segundo o texto, como as ideias de Denis Diderot se opunham ao imperialismo? ', 'No pensamento de Jean-Jacques Rousseau, qual a relação entre a ideia de “homem no estado de natureza” e a organização das sociedades civilizadas?', '', 'Segundo o texto, as ideias de Diderot se opunham ao imperialismo por afirmar que as diferenças culturais são próprias do ser humano, o que leva à relatividade cultural; dessa maneira não há uma escala universal de valores, nem pode haver culturas consideradas superiores ou inferiores. ', 'No pensamento de Rousseau, o homem é naturalmente bom e a vida em sociedade o corrompe; nessa passagem do estado de natureza para a civilização, têm origem as desigualdades e a propriedade privada, tornando-se necessário um contrato social. Por meio do contrato social, que organiza as sociedades civilizadas, cada indivíduo abdica de seus direitos em nome do Estado, que deve defendê-lo, devendo a vontade geral nortear as decisões do Estado.', '', NULL, 3, 19, 2, '', 1),
(46, 2018, '', 'Os soviéticos tinham chegado a Cuba muito cedo na década de 1960, esgueirando-se pela fresta aberta pela imediata hostilidade norte-americana ao processo social revolucionário. Durante três décadas os soviéticos mantiveram sua presença em Cuba com bases e ajuda militar, mas, sobretudo, com todo o apoio econômico que, como saberíamos anos mais tarde, mantinha o país à tona, embora nos deixasse em dívida com os irmãos soviéticos – e depois com seus herdeiros russos – com cifras que chegavam a US$ 32 bilhões. Ou seja, o que era oferecido em nome da solidariedade socialista tinha um preço definido. (PADURA, L. Cuba e os russos. Folha de São Paulo)', 'O texto indica que durante a Guerra Fria as relações internas em um mesmo bloco foram marcadas pelo(a)', 'busca da neutralidade política.', 'estímulo à competição comercial. ', 'subordinação à potência hegemônica.', 'elasticidade das fronteiras geográficas', 'compartilhamento das pesquisas científicas', 'C', '', 1, 17, 1, '', 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(49, 2012, , 'Com sua entrada no universo dos gibis, o Capitão chegaria para apaziguar a agonia, o autoritarismo militar e combater a tirania. Claro que, em tempos de guerra, um gibi de um herói com uma bandeira americana no peito aplicando um sopapo no Führer só poderia ganhar destaque, e o sucesso não demoraria muito a chegar. COSTA, C. Capitão América, o primeiro vingador: crítica. Disponível em: www.revistastart.com.br. Acesso em: 27 jan. 2012 (adaptado).', 'A capa da primeira edição norte-americana da revista do Capitão América demonstra sua associação com a participação dos Estados Unidos na luta contra  ', 'a Tríplice Aliança, na Primeira Guerra Mundial.', 'os regimes totalitários, na Segunda Guerra Mundial.', 'o poder soviético, durante a Guerra Fria.', 'o movimento comunista, na Guerra do Vietnã.', 'o terrorismo internacional, após 11 de setembro de 2001', 'B', '', 1, 17, 1, '', 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(50, 2009, '', 'A primeira metade do século XX foi marcada por conflitos e processos que a inscreveram como um dos mais violentos períodos da história humana.', 'Entre os principais fatores que estiveram na origem dos conflitos ocorridos durante a primeira metade do século XX estão', 'a crise do colonialismo, a ascensão do nacionalismo e do totalitarismo.', 'o enfraquecimento do império britânico, a Grande Depressão e a corrida nuclear.', 'o declínio britânico, o fracasso da Liga das Nações e a Revolução Cubana.', 'a corrida armamentista, o terceiro-mundismo e o expansionismo soviético.', 'a Revolução Bolchevique, o imperialismo e a unificação da Alemanha', 'A', '', 1, 17, 1, '', 1),
(51, 2009, '', 'Do ponto de vista geopolítico, a Guerra Fria dividiu a Europa em dois blocos. Essa divisão propiciou a formação de alianças antagônicas de caráter militar, como a OTAN, que aglutinava os países do bloco ocidental, e o Pacto de Varsóvia, que concentrava os do bloco oriental. É importante destacar que, na formação da OTAN, estão presentes, além dos países do oeste europeu, os EUA e o Canadá. Essa divisão histórica atingiu igualmente os âmbitos político e econômico que se refletia pela opção entre os modelos capitalista e socialista.', 'Essa divisão europeia ficou conhecida como  ', 'Cortina de Ferro.', 'Muro de Berlim.', 'União Europeia.', 'Convenção de Ramsar.', 'Conferência de Estocolmo.', 'A', '', 1, 17, 1, '', 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(52, 2019, , 'A propaganda através de inscrições e desenhos em muros e paredes é uma parte integrante da Paris revolucionária de Maio de 1968. Ela se tornou uma atividade de massa, parte e parcela do método de autoexpressão da Revolução.', 'Considerando o texto e a imagem anteriores, assinale a alternativa correta sobre o movimento de maio de 1968.  ', 'Influenciadas pela política de Estado da União Soviética, as manifestações de 1968 foram desencadeadas pelos operários franceses, que exigiam melhores condições de trabalho, por meio das pichações em muros espalhados pela cidade', 'Influenciadas pelo contexto cultural da Guerra Fria, as manifestações de 1968 tinham como palavras de ordem a liberdade de expressão política e sexual, como se via nas inscrições nos muros de Paris.', 'Influenciadas pelos movimentos punk-anarquistas ingleses, as manifestações de 1968 na França foram responsáveis pelo enfraquecimento do então presidente Charles De Gaulle e seu lema aparecia em inscrições nos muros.', 'Influenciadas por ideias esquerdistas, comunistas e anarquistas, as manifestações de 1968 ficaram restritas às camadas populares francesas, sendo que as inscrições nos muros das cidades indicavam o grupo social responsável', '', 'B', '', 2, 17, 1, '', 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(53, 2013, '', 'Em discurso proferido no dia 12/03/1947, o presidente dos EUA, Harry Truman, afirmou: “O governo grego tem operado numa atmosfera de caos e extremismo. A extensão da ajuda a esse país não quer dizer que os Estados Unidos estão de acordo com tudo o que o seu governo tem feito ou fará. No momento atual da história do mundo quase todas as nações se veem na contingência de escolher entre modos alternativos de vida. E a escolha, frequentes vezes, não é livre.” (Harold C. Syrett (org.), Documentos Históricos dos Estados Unidos. São Paulo: Cultrix, 1980, p. 316-317.)', 'Considerando o discurso do presidente Truman, bem como os processos históricos do pós-Segunda Guerra Mundial, é correto afirmar que:', 'A “contingência de escolher entre modos alternativos de vida” se referia à escolha entre o fascismo alemão e a democracia liberal.', 'O caos do governo grego era uma referência aos problemas da Grécia com o Mercado Comum Europeu e a necessidade de ajuda ao governo de Atenas.', 'O discurso nasceu do declínio do auxílio britânico na região da Grécia e da ascensão norte-americana no contexto da Guerra Fria.', 'O discurso é uma resposta ao Plano Marshall, que o governo de Londres tentava impor à Grécia, por meio do Banco Central Europeu.', '', 'C', '', 2, 17, 1, '', 1),
(54, 2011, '', 'Para muitos norte-americanos, Vietnã é o nome de uma guerra, não de um país. Os vietnamitas parecem figuras sombrias, sem nome nem rosto, vítimas desamparadas ou agressores cruéis. A história começa apenas quando os Estados Unidos entram em cena. (Adaptado de Marvin E. Gettleman et. alli (Ed.), Vietnam and America: a documented history. New York: Grove Press, 1995, p. xiii.)', 'Esse desconhecimento dos norte-americanos quanto a seus adversários na Guerra do Vietnã pode ser relacionado ao fato de os norte-americanos', 'promoverem uma guerra de trincheiras, enquanto os vietnamitas comunistas movimentavam seus batalhões pela selva. Contando com um forte apoio popular, os Estados Unidos permaneceram por anos nesse conflito, mas não conseguiram derrotar os vietnamitas.', 'invadirem e ocuparem o território vietnamita, desmantelando os batalhões comunistas graças à superioridade americana em treinamento militar e armamentos. Apesar do apoio popular à guerra, os Estados Unidos desocuparam o território vietnamita.', 'desconhecerem as tradições dos vietnamitas, organizados em torno de líderes tribais, que eram os chefes militares de seus clãs. Sem ter um Estado como adversário, o conflito se arrastou e, sem apoio popular, os Estados Unidos acabaram se retirando.', 'encontrarem grande dificuldade em enfrentar as táticas de guerrilha dos vietnamitas comunistas, que tinham maior conhecimento territorial. Após várias derrotas e sem apoio popular em seu próprio país, os Estados Unidos retiraram suas tropas do Vietnã.', '', 'D', '', 2, 17, 1, '', 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(61, 2017, , 'A charge de Carlos Latuff, publicada em 2016, faz associações sobre diversos processos do mundo contemporâneo. A primeira-ministra britânica, Theresa May, ouve uma voz enquanto carrega tijolos para a construção de um polêmico muro em Calais, na França.', '', 'Explique qual é a justificativa histórica para a exclamação “hipócritas” oriunda do muro de Berlim.', 'Por que a questão dos muros tornou-se um assunto recorrente na política internacional do século XXI? Justifique sua resposta a partir de uma das referências da charge.', '', 'A charge de Carlos Latuff, publicada em 2016, ironiza a posição da Inglaterra, representada pela figura da primeira-ministra britânica Thereza May, pertencente ao Partido Conservador, de defender a construção de novos muros que supostamente poderiam impedir a entrada de imigrantes em países europeus, como a Inglaterra e a França. O muro em construção na charge (sendo cimentado por um operário sem rosto) refere-se a Calais, acampamento de refugiados vindos do Afeganistão, Sudão e Eritreia, situado no norte da França. A hipocrisia, estampada no vestígio material do muro de Berlim, viria do fato de que a Inglaterra, ao longo de todo o período marcado pelo conflito da Guerra Fria, foi uma das nações defensoras da derrubada desse muro, que simbolizava a divisão do mundo entre capitalismo e comunismo. Dessa forma, a contradição estaria na mudança de postura das nações que se posicionavam como defensora da liberdade ao longo da segunda metade do século XX, mas, agora, estariam defendendo o fe', 'A construção de muros expressa a ampliação dos discursos xenofóbicos, isolacionistas e ultrarreligiosos que estão presentes em diversas partes do mundo atual. Com o avanço dos partidos conservadores na liderança de diversas nações do mundo houve uma reconfiguração da política internacional e a tentativa de restrição à circulação de pessoas consideradas indesejadas, como os refugiados e os imigrantes ilegais. Os muros indicados na charge são exemplos do fortalecimento de discursos de ódio e preconceitos, como se observa nos muros já existentes na Palestina, nos EUA/México e na proposta do muro de Calais.', '', NULL, 3, 17, 2, '', 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(62, 2014, , 'O cartaz abaixo foi usado pela propaganda soviética contra o capitalismo ocidental, durante o período da Guerra Fria. O texto diz: “Duas infâncias. Na URSS (parte superior) crianças são apoiadas pelo amor da nação! Nos países capitalistas (figura inferior), milhões de crianças vivem sem comida ou abrigo.”', '', 'Como o cartaz descreve a sociedade capitalista ocidental?', 'Cite dois conflitos bélicos do período da Guerra Fria.', '', 'A propaganda soviética faz uma crítica a sociedade capitalista no que diz respeito aos cuidados com a infância, representando, na parte inferior da imagem, crianças em um ambiente degradado e marcado pela pobreza, consequência das injustiças sociais e econômicas que os socialistas atribuem no sistema capitalista.', 'Poderiam ser citados conflitos bélicos ocorridos na Ásia (Guerra da Coreia, Guerra do Vietnã), na África (lutas de descolonização), na América (Crise dos Misseis e Invasão da Baia dos Porcos em Cuba) e no Oriente Médio.', '', NULL, 3, 17, 2, '', 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(63, 2014, '', 'Três décadas — de 1884 a 1914 — separam o século XIX — que terminou com a corrida dos países europeus para a África e com o surgimento dos movimentos de unificação nacional na Europa — do século XX, que começou com a Primeira Guerra Mundial. É o período do Imperialismo, da quietude estagnante na Europa e dos acontecimentos empolgantes na Ásia e na África. ARENDT, H. As origens do totalitarismo. São Paulo: Cia. das Letras, 2012.', 'O processo histórico citado contribuiu para a eclosão da Primeira Grande Guerra na medida em que:', 'difundiu as teorias socialistas.', 'acirrou as disputas territoriais.', 'superou as crises econômicas.', ' multiplicou os conflitos religiosos', 'conteve os sentimentos xenófobos.', 'B', '', 1, 25, 1, '', 1),
(64, 2015, '', 'O relato a seguir é parte da biografia de um homem que passou sua infância no atual Mali. Em novembro de 1918, a África, como a metrópole, festejou o fim da Grande Guerra Mundial e a vitória da França e seus aliados (…). Estávamos orgulhosos do papel desempenhado pelos soldados africanos na frente de batalha. (…) Os sobreviventes que voltaram em 1918- 1919 foram a causa de um novo fenômeno social que influiu na evolução da mentalidade nativa. Estou falando do fim do mito do homem branco como ser invencível e sem defeitos. (Amadou Hampâté Bâ, Amkoullel, o menino fula. São Paulo: Palas Athena/Casa das Áfricas, 2003, p. 312-313.)', 'Considerando o relato acima, é correto afirmar que', 'a presença dos soldados africanos contribuiu para construir uma identidade africana sustentada nos princípios bélicos do imperialismo europeu.', 'a presença de soldados africanos nos conflitos contribuiu para o questionamento do mito da superioridade do homem branco.', 'o autor, ao apresentar a fragilidade do homem branco, instaurou um discurso inverso de superioridade dos africanos.', 'o autor, ao apresentar o norte da África como parte da França, exaltou o projeto imperialista francês e suas estratégias de integração cultural.', '', 'B', '', 2, 25, 1, '', 1),
(65, 2019, '', 'O período de 1840 a 1890 é o do triunfo da ideologia do progresso, simultaneamente ao grande boom econômico e industrial do Ocidente. (Adaptado de Jacques Le Goff, História e memória. Campinas: Editora da Unicamp, 1990, p. 204-245.)', 'Com base no texto e em seus conhecimentos históricos,', 'apresente duas características importantes do boom econômico e industrial do Ocidente entre 1840 e 1890;', 'explique o ideário do progresso e o relacione com a Primeira Guerra Mundial.', '', 'São características do boom econômico e industrial do Ocidente entre 1840 e 1890: a Revolução Industrial em seu segundo momento, em que se destacam grandes inovações tecnológicas como a eletricidade, o uso do petróleo, o desenvolvimento das ferrovias etc.; o Imperialismo, com o neocolonialismo avançando sobre territórios como a África e a Ásia; a ampliação de mercados consumidores, especialmente aqueles reconhecidos como periféricos; a primazia da Inglaterra vitoriana como Império de destaque no período; o crescimento urbano, com intensa exploração das classes operárias e precarização de suas condições de vida nas cidades.', 'O ideário de progresso do século XIX poderia ser identificado como uma característica marcante do período. Propunha a permanente evolução das sociedades rumo a um futuro sempre mais promissor que o presente. Nesse sentido, trazia um culto ao desenvolvimento tecnológico e à ciência, que estabeleciam um padrão europeu para se pensar um mundo civilizado. Esse ideário poderia ser relacionado à Primeira Guerra Mundial na medida em que o desenvolvimento tecnológico foi amplamente demonstrado por meio das inovações bélicas postas em uso nesse conflito. Ele favoreceu também o nacionalismo e a ideia de superioridade europeia, que legitimou a subjugação de múltiplos territórios, levando a conflitos pelo domínio colonial e ao colapso do próprio imperialismo.', '', NULL, 3, 25, 2, '', 1),
(66, 2017, '', 'O New Deal visa restabelecer o equilíbrio entre o custo de produção e o preço, entre a cidade e o campo, entre os preços agrícolas e os preços industriais, reativar o mercado interno — o único que é importante —, pelo controle de preços e da produção, pela revalorização dos salários e do poder aquisitivo das massas, isto é, dos lavradores e operários, e pela regulamentação das condições de emprego. CROUZET, M. História geral das civilizações.', 'Tendo como referência os condicionantes históricos do entreguerras, as medidas governamentais descritas objetivavam', 'flexibilizar as regras do mercado financeiro', 'fortalecer o sistema de tributação regressiva.', 'introduzir os dispositivos de contenção creditícia.', 'racionalizar os custos da automação industrial mediante negociação sindical.', 'recompor os mecanismos de acumulação econômica por meio da intervenção estatal.', 'E', '', 1, 28, 1, '', 1),
(67, 2017, '', 'E venham, então, os alegres incendiários de dedos carbonizados! Vamos! Ateiem fogo às estantes das bibliotecas! Desviem os cursos dos canais, para inundar os museus! Empunhem as picaretas, os machados, os martelos e deitem abaixo sem piedade as cidades veneradas. MARINETI, F. Manifesto futurista).', 'Que princípio marcante do Futurismo e comum a várias correntes artísticas e culturais das primeiras três décadas do século XX está destacado no texto?', 'A tradição é uma força incontornável.', 'A arte é expressão da memória coletiva.', 'A modernidade é a superação decisiva da história.', 'A realidade cultural é determinada economicamente.', 'A memória é um elemento crucial da identidade cultural', 'C', '', 1, 28, 1, '', 1),
(68, 2013, '', 'As Brigadas Internacionais foram unidades de combatentes formadas por voluntários de 53 nacionalidades dispostos a lutar em defesa da República espanhola. Estima-se que cerca de 60 mil cidadãos de várias partes do mundo – incluindo 40 brasileiros – tenham se incorporado a essas unidades. Apesar de coordenadas pelos comunistas, as Brigadas contaram com membros socialistas, liberais e de outras correntes político-ideológicas. SOUZA, I. I. A Guerra Civil Europeia. História Viva, n. 70, 2009 (fragmento).', 'A Guerra Civil Espanhola expressou as disputas em curso na Europa na década de 1930:', 'crítica ao stalinismo.', 'combate ao fascismo.', 'rejeição ao federalismo.', 'apoio ao corporativismo.', 'adesão ao anarquismo', 'B', '', 1, 28, 1, '', 1),
(69, 2012, '', 'Texto I<br>    A Europa entrou em estado de exceção, personificado por obscuras forças econômicas sem rosto ou localização física conhecida que não prestam contas a ninguém e se espalham pelo globo por meio de milhões de transações diárias no ciberespaço. ROSSI, C. Nem fim do mundo nem mundo novo. Folha de São Paulo, 11 dez. 2011 (adaptado).<br><br>       Texto II <br> Estamos imersos numa crise financeira como nunca tínhamos visto desde a Grande Depressão iniciada em 1929 nos Estados Unidos. Entrevista de George Soros. Disponível em: www.nybooks.com. Acesso em: 17 ago. 2011 (adaptado).', 'A comparação entre os significados da atual crise econômica e do crash de 1929 oculta a principal diferença entre essas duas crises, pois', 'o crash da Bolsa em 1929 adveio do envolvimento dos EUA na I Guerra Mundial e a atual crise é o resultado dos gastos militares desse país nas guerras do Afeganistão e Iraque.', 'a crise de 1929 ocorreu devido a um quadro de superprodução industrial nos EUA e a atual crise resultou da especulação financeira e da expansão desmedida do crédito bancário.', 'a crise de 1929 foi o resultado da concorrência dos países europeus reconstruídos após a I Guerra e a atual crise se associa à emergência dos BRICS como novos concorrentes econômicos.', 'o crash da Bolsa em 1929 resultou do excesso de proteções ao setor produtivo estadunidense e a atual crise tem origem na internacionalização das empresas e no avanço da política de livre mercado.', 'a crise de 1929 decorreu da política intervencionista norte-americana sobre o sistema de comércio mundial e a atual crise resultou do excesso de regulação do governo desse país sobre o sistema monetário.', 'B', '', 1, 28, 1, '', 1),
(70, 2020, '', ' Na Era da Catástrofe (1914-1945), com a Grande Depressão desencadeada pela crise de 1929, tornava-se cada vez mais claro que a paz, a estabilidade social, a economia, as instituições políticas e os valores intelectuais da sociedade liberal burguesa entraram em decadência ou colapso. (Adaptado de E. J. Hobsbawm, Era dos extremos: o breve século XX, 1914-1991. São Paulo: Companhia das Letras, 1995, p. 112.)', 'A partir do excerto acima e dos conhecimentos sobre o período histórico que vai de 1914 a 1945, é correto afirmar:', 'A crise de 1929 e as guerras mundiais levaram ao colapso do liberalismo político e econômico na Europa e, ao mesmo tempo, à expansão das democracias liberais em países africanos e do Oriente Médio.', 'As soluções para a crise de 1929 centraram-se em um aprofundamento das políticas liberais do New Deal, que promoviam responsabilidade fiscal e diminuição do papel do Estado como motor de desenvolvimento.', 'São marcos da crise do liberalismo na Europa: o colapso das principais democracias, a ascensão de governos totalitários e autoritários e a descrença no livre-mercado após a crise de 1929.', 'Verificou-se nesse período o colapso das democracias liberais, com a ascensão do totalitarismo na Europa, e o aumento das liberdades econômicas, com a diminuição do papel do Estado como solução para a crise de 1929.', '', 'C', '', 2, 28, 1, '', 1),
(71, 2017, '', 'Após a Declaração Universal dos Direitos Humanos pela ONU, em 1948, a Unesco publicou estudos de cientistas de todo o mundo que desqualificam as doutrinas racistas e demonstraram a unidade do gênero humano. Desde então, a maioria dos próprios cientistas europeus passou a reconhecer o caráter discriminatório da pretensa superioridade racial do homem branco e a condenar as aberrações cometidas em seu nome. SILVEIRA, R.', 'A posição assumida pela Unesco, a partir de 1948, foi motivada por acontecimentos então recentes, dentre os quais se destacava o(a)', 'ataque feito pelos japoneses à base militar americana de Pearl Harbor.', 'desencadeamento da Guerra Fria e de novas rivalidades entre nações. ', 'morte de milhões de soldados nos combates da Segunda Guerra Mundial.', 'execução de judeus e eslavos presos em guetos e campos de concentração nazistas.', 'lançamento de bombas atômicas em Hiroshima e Nagasaki pelas forças norte-americanas.', 'D', '', 1, 26, 1, '', 1),
(72, 2015, '', 'A participação da África na Segunda Guerra Mundial deve ser apreciada sob a ótica da escolha entre vários demônios. O seu engajamento não foi um processo de colaboração com o imperialismo, mas uma luta contra uma forma de hegemonia ainda mais perigosa. MAZRUI, A. “Procurai primeiramente o reino político”. (Org.). História geral da África: África desde 1925. Brasília: Unesco, 2010.', 'Para o autor, a “forma de hegemonia” e uma de suas características que explicam o engajamento dos africanos no processo analisado foram:', 'Comunismo / rejeição da democracia liberal.', 'Capitalismo / devastação do ambiente natural.', 'Fascismo / adoção do determinismo biológico.', 'Socialismo / planificação da economia nacional', 'Colonialismo / imposição da missão civilizatória.', 'C', '', 1, 26, 1, '', 1),
(73, 2014, '', ' Em 1942, os estúdios Disney produziram o desenho “Alô Amigos”, que apresenta a personagem Zé Carioca. Dois anos depois surgiu uma nova animação: The Three Caballeros, conhecida no Brasil como “Você já foi à Bahia?”. Nos desenhos citados, o Brasil e a América Latina são mostrados de forma simpática, através de estereótipos.', 'Para entender esses desenhos e o esforço de Walt Disney, devemos considerar o seguinte contexto:', 'a Segunda Guerra Mundial e a política de boa vizinhança.', 'o avanço da Guerra Fria e o episódio da Crise dos Mísseis de Cuba.', 'a política do “Big Stick” e os resultados da diplomacia do dólar.', 'o avanço do populismo e a tentativa de Truman de barrar esta influência.', '', 'A', '', 2, 26, 1, '', 1),
(74, 2019, '', 'A Agência da ONU para Refugiados (ACNUR) foi criada em dezembro de 1950 por resolução da Assembleia Geral das Nações Unidas. Iniciou suas atividades em janeiro de 1951. O Protocolo de 1967 reformou a Convenção de 1951 e expandiu o mandato da ACNUR para além das fronteiras europeias e das pessoas afetadas pela Segunda Guerra Mundial. Em 1995, a Assembleia Geral designou a ACNUR como responsável pela proteção e assistência dos apátridas em todo o mundo. Nas últimas décadas, os deslocamentos forçados atingiram níveis sem precedentes. Estatísticas recentes revelam que mais de 67 milhões de pessoas no mundo todo deixaram seus locais de origem por causa de conflitos, perseguições e graves violações de direitos humanos. (Adaptado de http://www.acnur.org/portugues/convencao-de-1951/. Acessado em 31/08/2018.)', '', 'Explique o contexto de criação da ACNUR e seu principal objetivo.', 'Levando em consideração os princípios da ONU, relacione a condição de refugiado com a noção de cidadania e de direitos humanos.', '', 'O Alto Comissariado das Nações Unidas para Refugiados, ACNUR, foi criado após a Segunda Guerra Mundial, quando a Europa ainda lidava com boa parte dos problemas decorrentes do conflito. Entre esses problemas, destaca-se o grande número de refugiados que precisaram abandonar seus países de origem. Os candidatos deveriam indicar que, nesse contexto, a ACNUR oferecia assistência aos refugiados europeus; a assistência a um público mais ampliado viria em anos posteriores, como informa o texto.', 'Os princípios da ONU garantem que “todos os seres humanos nascem livres e iguais em dignidade e direitos”. Esses princípios são mobilizados pela agência para garantir que refugiados não sejam vítimas da violação de direitos humanos e para assegurar o seu acesso à cidadania e a condições de vida que possam garantir sua integridade física.', '', NULL, 3, 26, 2, '', 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(75, 2011, , 'Quando Colin Powell chegar às Nações Unidas hoje para defender a guerra contra Saddam Hussein, as Nações Unidas planejam cobrir a obra-prima de Picasso, “Guernica”, com uma capa azul. Repórteres e câmeras irão cercar o secretário de Estado (cargo equivalente ao de ministro das Relações Exteriores) na entrada do Conselho de Segurança das Nações Unidas, onde a reprodução de “Guernica” está pendurada. De fato, Powell não pode convencer o mundo sobre a necessidade de bombardear o Iraque cercado por mulheres, homens, crianças, touros e cavalos aos gritos e mutilados. (Adaptado de Maureen Dowd, “Powell without Picasso”. http://www.nytimes.com/2003/02/05/opinion/powell-without-picasso.html. Acesso em 06/12/2010.)', '', 'Quais eram as mensagens incompatíveis entre a fala de Colin Powell e a obra Guernica de Picasso? ', 'Identifique os acontecimentos políticos associados à obra Guernica.', '', 'A fala de Colin Powell tinha por objetivo a defesa dos ataques norte-americanos contra o Iraque, enquanto a obra de Picasso tinha uma mensagem pacifista, denunciando o horror da guerra.', 'Essa obra faz referência ao bombardeio da cidade espanhola de Guernica, durante a Guerra Civil Espanhola. Nessa guerra, a direita espanhola (monarquistas e nacionalistas sob o comando de Franco) recebe o apoio da Alemanha nazista, responsável pelo bombardeio. Posteriormente, esse bombardeio seria interpretado também como um ensaio ou laboratório para os bombardeios sobre alvos civis que seriam realizados na Segunda Guerra Mundial.', '', NULL, 3, 26, 2, '', 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(77, 2009, '', 'Os regimes totalitários da primeira metade do século XX apoiaram-se fortemente na mobilização da juventude em torno da defesa de ideias grandiosas para o futuro da nação. Nesses projetos, os jovens deveriam entender que só havia uma pessoa digna de ser amada e obedecida, que era o líder. Tais movimentos sociais juvenis contribuíram para a implantação e a sustentação do nazismo, na Alemanha, e do fascismo, na Itália, Espanha e Portugal.', 'A atuação desses movimentos juvenis caracterizava-se', 'pelo sectarismo e pela forma violenta e radical com que enfrentavam os opositores ao regime.', 'pelas propostas de conscientização da população acerca dos seus direitos como cidadãos.', 'pela promoção de um modo de vida saudável, que mostrava os jovens como exemplos a seguir.', 'pelo diálogo, ao organizar debates que opunham jovens idealistas e velhas lideranças conservadoras.', 'pelos métodos políticos populistas e pela organização de comícios multitudinários.', 'A', '', 1, 16, 1, NULL, 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(78, 2019, , 'Bella Ciao\r<br>\r<br>Querida, adeus\r<br>Esta manhã, eu acordei\r<br>Querida, adeus! Querida, adeus! Querida, adeus, adeus, adeus! Esta manhã, eu acordei\r<br>E encontrei um invasor\r<br>\r<br>Oh, membro da Resistência, leve-me embora\r<br>Querida, adeus! Querida, adeus! Querida, adeus, adeus, adeus! Oh, membro da Resistência, leve-me embora\r<br>Porque sinto que vou morrer\r<br>\r<br>E se eu morrer como um membro da Resistência\r<br>Querida, adeus! Querida, adeus! Querida, adeus, adeus, adeus! E se eu morrer como um membro da Resistência\r<br>Você deve me enterrar\r<br>\r<br>E me enterre no alto da montanha\r<br>Querida, adeus! Querida, adeus! Querida, adeus, adeus, adeus!\r<br>E me enterre no alto da montanha\r<br>Sob a sombra de uma bela flor. (...).\r<br>\r<br>A fotografia anterior registra a fachada do Partido Nacional Fascista de Benito Mussolini em 1934. A música Bella Ciao foi um hino cantado contra o fascismo de Mussolini e as tropas nazistas durante a Segunda Guerra Mundial. Em 25 de abril de 2018, quando a Itália celebrou 73 anos de sua libertação do nazifascismo, a canção foi entoada em várias partes do país.', 'Sobre os usos da imagem e da música, assinale a alternativa correta.  ', 'Através de vários mecanismos de propaganda ideológica e coerção física, os italianos foram forçados a entoar a música Bella Ciao, a fim de demonstrar publicamente sua adesão ao fascismo. Este caráter umbilical da relação da massa com o líder aparece retratado na fotografia.', 'Por se tratar de um produto da indústria cultural com forte apelo comercial, compreende-se a circulação e o consumo desta música em plano global e em várias mídias (shows musicais, novelas e séries). Neste sentido, a imagem é um cartaz caracterizado pela neutralidade política.', 'Trata-se de uma música de alcance internacional entoada em várias partes do mundo, em diferentes contextos de resistência política contra o fascismo, regime caracterizado pela adesão da massa em relação ao seu líder, como explicita a fotografia.', 'O gesto que recupera em 2018 esta canção sugere uma semelhança entre o tempo de antes (do fascismo) e o de hoje, aproximando Silvio Berlusconi de Mussolini, dirigente retratado na fotografia. Antes, como agora, Bella Ciao exalta a resistência, identificando-se como uma canção nacionalista.', '', 'C', '', 2, 16, 1, NULL, 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(79, 2017, '', 'Hitler considerava que a propaganda sempre deveria ser popular, dirigida às massas, desenvolvida de modo a levar em conta um nível de compreensão dos mais baixos. (...) O essencial da propaganda era atingir o coração das grandes massas, compreender seu mundo maniqueísta, representar seus sentimentos.” (Alcir Lenharo, Nazismo: o triunfo da vontade. São Paulo: Ática,1986, p. 47- 48.)', 'Sobre a propaganda no nazismo, é correto afirmar:', 'o nível elementar da propaganda era contraposto às óperas e desfiles suntuosos que o regime nazista promovia.', ' a propaganda deveria restringir-se a poucos pontos, como o enaltecimento da superioridade racial e a defesa da democracia.', 'a propaganda deveria estimular o ódio das massas contra grupos específicos, como os judeus, negros, homossexuais e ciganos.', 'o cinema e a produção artística foram as áreas que resistiram ao sistema de propaganda do nazismo na Alemanha do final da década de 1930', '', 'C', '', 2, 16, 1, NULL, 1),
(80, 2020, '', 'Pode parecer inconcebível que um crime de proporções gigantescas como o Holocausto, que também é um dos crimes mais bem documentados, estudados e testemunhados da história, possa ser negado, especialmente hoje, quando são numerosos os meios de informação sobre o tema. (Adaptado de Bruno Leal Pastor de Carvalho, “O negacionismo do Holocausto na internet”. Faces da História, Assis, v. 3, n.1, jan.- jun. 2016, p. 6.)', 'A partir do excerto e de seus conhecimentos,', 'apresente dois aspectos do negacionismo histórico;', 'analise o impacto da internet nos debates sobre o Holocausto no mundo contemporâneo.', '', 'O negacionismo histórico é um fenômeno social contemporâneo, observado em grupos da sociedade que argumentam contra conhecimentos históricos estabelecidos e amplamente documentados. O negacionismo histórico pretende afirmar-se como revisionismo histórico, valendo-se muitas vezes da ocultação dos documentos ou de documentos falsos, ignorando evidências presentes nas fontes históricas. ', 'A internet permite a divulgação de informações e debates em uma escala bastante ampliada e de forma muito veloz. No caso específico dos debates sobre o Holocausto, permitiu a ampliação do alcance do discurso que nega o genocídio e a divulgação de materiais voltados para o revisionismo histórico do evento (vídeos, blogs, podcast, entre outros). Por outro lado, também ampliou o acesso a diferentes categorias de fontes históricas que comprovam a realidade do holocausto (depoimentos orais de sobreviventes, imagens dos campos de concentração, entre outras), documentários e livros acerca do genocídio. Em síntese, trata-se de um processo contraditório, em que a maior circulação de informações não necessariamente se desdobra em ampliação do conhecimento.', '', NULL, 3, 16, 2, NULL, 1),
(81, 2018, '', ' A campanha nazista contra a arte moderna começa com a tomada de poder. Em 1933, Hitler fecha a Bauhaus e promove a primeira exposição difamatória da arte moderna em Karlsruhe e Mannheim. Segue-se a cassação de diversos curadores, diretores de museus e artistas-professores. Os artistas começam a emigrar. Livros são queimados em praça pública e inicia-se um verdadeiro processo de expropriação arbitrária pelos nazistas dos acervos dos museus: mais de 16.500 obras de arte consideradas degeneradas são confiscadas, muitas das quais foram destruídas ou perdidas. Obras de valor - como Auto-Retrato, de Vincent van Gogh ou Acrobata e Jovem Arlequim, de Pablo Picasso - são vendidas em um leilão em 1939 na Galeria Fischer, na Suíça, e revertidas em divisas para os nazistas. (Adaptado do verbete “Arte Degenerada” da Enciclopédia Itaú Cultural disponível em http://enciclopedia.itaucultural.org.br/termo328/ arte-degenerada. Acessado em 31 de agosto de 2017).', '', 'A partir do texto acima e de seus conhecimentos, explique o que foi o projeto estético do nazismo.', 'Indique duas formas da violência perpetrada pelo regime nazista.', '', 'Era esperado que o candidato desenvolvesse a ideia de que o projeto estético do nazismo, baseado em princípios eugênicos, definia o padrão de beleza e saúde ariano como o único possível, além de estabelecer os padrões artísticos a serem produzidos e consumidos, reforçando aspectos que levaram ao uso constante da arte como propaganda política. O projeto estético nazista marcava, ainda, quem poderia fazer arte no regime totalitário vigente, já que este censurava, condenava e destruía obras que divergiam do padrão estipulado – como é o caso, em especial, da arte moderna, considerada degenerada.', 'Numerosas formas de violência perpetradas pelo regime nazista poderiam ser citadas na alternativa. Entre elas, os campos de concentração, a formação de guetos, o confisco de bens, as políticas médicas de eugenia que desembocaram no genocídio sistemático, o fuzilamento sumário, a migração forçada e a própria prática da guerra.', '', NULL, 3, 16, 2, NULL, 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(82, 2016, , 'O painel pintado por Pablo Picasso em 1937, Guernica, é uma referência ao bombardeio da área de mesmo nome, durante a Guerra Civil Espanhola (1936-1939).', '', 'Apresente os principais aspectos visuais dessa obra de Picasso.', 'De que forma a imagem pode ser compreendida como uma crítica ao franquismo?', '', ' A obra de Pablo Picasso é marcada pelo uso de contrastes, pela representação de corpos retorcidos e desmembrados. As referências a destruição e a dor são representadas em formas decompostas e com ausência de perspectiva, utilizadas pelo cubismo.', ' O ideário fascista de dizimação total dos adversários é uma das críticas feitas por Picasso ao franquismo. A brutalidade do ataque a Guernica é representada por corpos fragmentados e por outras referências a perseguição contra republicanos, comunistas e a princípios liberais, no contexto da Guerra Civil espanhola.', '', NULL, 3, 16, 2, NULL, 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(83, 2019, '', 'TEXTO I\r<br>A centralização econômica, o protecionismo e a expansão ultramarina engrandeceram o Estado, embora beneficiassem a burguesia incipiente. ANDERSON, P. In: DEYON, P. O mercantilismo. Lisboa: Gradiva,1989 (adaptado).\r<br>\r<br>TEXTO II\r<br>As interferências da legislação e das práticas exclusivistas restringem a operação benéfica da lei natural na esfera das relações econômicas. SMITH, A. A riqueza das Nações. São Paulo: Abril Cultural, 1983 (adaptado).', 'Entre os séculos XVI e XIX, diferentes concepções sobre as relações entre Estado e economia foram formuladas. Tais concepções, associadas a cada um dos textos, confrontam-se, respectivamente, na oposição entre as práticas de', 'valorização do pacto colonial — combate à livre- -iniciativa.', 'defesa dos monopólios régios — apoio à livre concorrência.', 'formação do sistema metropolitano — crítica à livre navegação.', 'abandono da acumulação metalista — estímulo ao livre-comércio.', 'eliminação das tarifas alfandegárias — incentivo ao livre-cambismo.', 'B', '', 1, 14, 1, NULL, 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(84, 2012, , '', 'Na França, o rei Luís XIV teve sua imagem fabricada por um conjunto de estratégias que visavam sedimentar uma determinada noção de soberania. Neste sentido, a charge apresentada demonstra', 'a humanidade do rei, pois retrata um homem comum, sem os adornos próprios à vestimenta real.', 'a unidade entre o público e o privado, pois a figura do rei com a vestimenta real representa o público e sem a vestimenta real, o privado.', 'o vínculo entre monarquia e povo, pois leva ao conhecimento do público a figura de um rei despretensioso e distante do poder político.', 'o gosto estético refinado do rei, pois evidencia a elegância dos trajes reais em relação aos de outros membros da corte.', 'a importância da vestimenta para a constituição simbólica do rei, pois o corpo político adornado esconde os defeitos do corpo pessoa', 'E', '', 1, 14, 1, NULL, 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(85, 2009, '', 'O que se entende por Corte do antigo regime é, em primeiro lugar, a casa de habitação dos reis de França, de suas famílias, de todas as pessoas que, de perto ou de longe, dela fazem parte. As despesas da Corte, da imensa casa dos reis, são consignadas no registro das despesas do reino da França sob a rubrica significativa de Casas Reais. ELIAS, N. A sociedade de corte. Lisboa: Estampa, 1987.', 'Algumas casas de habitação dos reis tiveram grande efetividade política e terminaram por se transformar em patrimônio artístico e cultural, cujo exemplo é', 'o palácio de Versalhes.', 'o Museu Britânico.', 'a catedral de Colônia.', 'a Casa Branca.', 'a pirâmide do faraó Quéops', 'A', '', 1, 14, 1, NULL, 1),
(86, 2018, '', 'Na formação das monarquias confessionais da Época Moderna houve reforço das identidades territoriais, em função de critérios de caráter religioso ou confessional. Simultaneamente, houve uma progressiva incorporação da Igreja ao corpo do Estado, através de medidas de caráter patrimonial e jurisdicional que procuravam uma maior sujeição das estruturas e agentes eclesiásticos ao poder do príncipe. Na busca pela homogeneização da fé dentro de um território político, a Igreja cumpria também papel fundamental na formação do Estado moderno por meio de seus mecanismos de disciplinamento social dos comportamentos. (Adaptado de Frederico Palomo, A Contra-Reforma em Portugal, 1540-1700. Lisboa: Livros Horizonte, 2006, p.52.)', 'Considerando o texto acima e seus conhecimentos sobre a Europa Moderna, assinale a alternativa correta.', 'Cada monarquia confessional adotou uma identidade religiosa e medidas repressivas em relação às dissidências religiosas que poderiam ameaçar tal unidade.', 'Monarquias confessionais são aquelas unidades políticas nas quais havia a convivência pacífica de duas ou mais confissões religiosas, num mesmo território.', 'São consideradas monarquias confessionais os territórios protestantes que se mostravam mais propícios ao desenvolvimento do capitalismo comercial, tornando-se, assim, nações enriquecidas.', 'As monarquias confessionais contavam com a instituição do Tribunal do Santo Ofício da Inquisição em seu território, uma forma de controle cultural sobre religiões politeístas.', '', 'A', '', 2, 14, 1, NULL, 1),
(87, 2016, '', 'Quanto seja louvável a um príncipe manter a fé, aparentar virtudes e viver com integridade, não com astúcia, todos o compreendem; contudo, observa-se, pela experiência, em nossos tempos, que houve príncipes que fizeram grandes coisas, mas em pouca conta tiveram a palavra dada, e souberam, pela astúcia, transtornar a cabeça dos homens, superando, enfim, os que foram leais (...). Um príncipe prudente não pode nem deve guardar a palavra dada quando isso se Ihe tome prejudicial e quando as causas que o determinaram cessem de existir.\r<br>(Nicolau Maquiavel, O Príncipe. São Paulo: Nova Cultural, 1997, p. 73-85 )', 'A partir desse excerto da obra, publicada em 1513, é correto afirmar que:', 'O jogo das aparências e a lógica da força são algumas das principais artimanhas da politica moderna explicitadas por Maquiavel.', 'A prudência, para ser vista como uma virtude, não depende dos resultados, mas de estar de acordo com os princípios da fé.', 'Os princípios e não os resultados é que definem o julgamento que as pessoas fazem do governante, por isso é louvável a integridade do príncipe.', 'A questão da manutenção do poder é o principal desafio ao príncipe e, por isso, ele não precisa cumprir a palavra dada, desde que autorizado pela Igreja.', '', 'A', '', 2, 14, 1, NULL, 1),
(88, 2014, '', ' À medida que as maneiras se refinam, tornam-se distintivas de uma superioridade: não é por acaso que o exemplo parece vir de cima e, logo, é retomado pelas camadas médias da sociedade, desejosas de ascender socialmente. É exibindo os gestos prestigiosos que os burgueses adquirem estatuto nobre. O ser de um homem se confunde com a sua aparência. Quem age como nobre é nobre. (Adaptado de Renato Janine Ribeiro, A Etiqueta no Antigo Regime. São Paulo: Editora Moderna, 1998, p. 12.)', 'O texto faz referência à prática da etiqueta na França do século XVIII. Sobre o tema, é correto afirmar que:', 'A etiqueta era um elemento de distinção social na sociedade de corte e definia os lugares ocupados pelos grupos próximos ao rei.', 'O jogo das aparências era uma forma de disfarçar os conluios políticos da aristocracia, composta por burgueses e nobres, e negar benefícios ao Terceiro Estado.', 'Os sans-culottes imitavam as maneiras da nobreza, pois isso era uma forma de adquirir refinamento e tornar-se parte do poder econômico no estado absolutista.', 'Durante o século XIX, a etiqueta deixou de ser um elemento distintivo de grupos sociais, pois houve a abolição da sociedade de privilégios', '', 'A', '', 2, 14, 1, NULL, 1),
(89, 2019, '', 'A Revolta da Vacina (1904) mostrou claramente o aspecto defensivo, desorganizado, fragmentado da ação popular. Não se negava o Estado, não se reivindicava participação nas decisões políticas; defendiam-se valores e direitos considerados acima da intervenção do Estado. CARVALHO, J. M. Os bestializados: o Rio de Janeiro e a República que não foi. São Paulo: Cia. das Letras, 1987 (adaptado).', 'A mobilização analisada representou um alerta, na medida em que a ação popular questionava', 'a alta de preços.', 'a política clientelista.', 'as reformas urbanas.', 'o arbítrio governamental.', 'as práticas eleitorais.', 'D', '', 1, 7, 1, NULL, 1),
(90, 2018, '', 'Os seus líderes terminaram presos e assassinados. A “marujada” rebelde foi inteiramente expulsa da esquadra. Num sentido histórico, porém, eles foram vitoriosos. A “chibata” e outros castigos físicos infamantes nunca foram oficialmente utilizados, a partir então, os marinheiros – agora respeitados – teriam suas condições de vida melhoradas significativamente. Sem dúvida, fizeram avançar a história. MAESTRI, M. 1910: a revolta dos marinheiros', 'A eclosão desse conflito foi resultado da tensão acumulada na Marinha do Brasil pelo(a)', 'engajamento de civis analfabetos após a emergência de guerras externas.', 'insatisfação de militares positivistas após a consolidação da política dos governadores.', 'rebaixamento de comandantes veteranos após a repressão a insurreições milenaristas.', 'sublevação das classes populares do campo após a instituição do alistamento obrigatório.', 'manutenção da mentalidade escravocrata da oficialidade após a queda do regime imperial', 'E', '', 1, 7, 1, NULL, 1),
(91, 2018, '', 'Código Penal dos Estados Unidos do Brasil, 1890\r<br> Dos crimes contra a saúde pública\r<br>Art. 156. Exercer a medicina em qualquer dos seus ramos, a arte dentária ou a farmácia; praticar a homeopatia, a dosimetria, o hipnotismo ou magnetismo animal, sem estar habilitado segundo as leis e regulamentos.\r<br>Art. 158. Ministrar, ou simplesmente prescrever, como meio curativo para uso interno ou externo, e sob qualquer forma preparada, substância de qualquer dos reinos da natureza, fazendo, ou exercendo assim, o ofício denominado curandeiro.', 'No início da Primeira República, a legislação penal vigente evidenciava o(a)', 'negligência das religiões cristãs sobre as moléstias.', 'desconhecimento das origens das crenças tradicionais.', 'preferência da população pelos tratamentos alopáticos.', 'abandono pela comunidade das práticas terapêuticas de magia.', 'condenação pela ciência dos conhecimentos populares de cura', 'E', '', 1, 7, 1, NULL, 1),
(92, 2018, '', 'Rodrigo havia sido indicado pela oposição como fiscal duma das mesas eleitorais. Pôs o revólver na cintura, uma caixa de balas no bolos e encaminhou-se para seu posto. A chamada dos eleitores começou às sete da manhã. Plantados junto da porta, os capangas do Trindade ofereciam cédulas com o nome dos candidatos oficiais a todos os eleitores que entravam. Estes, em quase totalidade, tomavam docilmente dos papeluchos e depositavam-nos na  urna, depois de assinar a autêntica. Os que se recusavam a isso tinham seus nomes acintosamente anotados. VERISSIMO, E. O tempo e o vento.', 'Erico Veríssimo tematiza em obra ficcional o seguinte aspecto característico da vida política durante a Primeira República:', 'Identificação forçada de homens analfabetos', 'Monitoramento legal dos pleitos legislativos.', 'Repressão explícita ao exercício de direito.', 'Propaganda direcionada à população do campo.', 'Cerceamento policial dos operários sindicalizados.', 'C', '', 1, 7, 1, NULL, 1),
(93, 2017, '', 'O instituto popular, de acordo com o exame da razão, fez da figura do alferes Xavier o principal dos inconfidentes, e colocou seu parceiros a meia ração de glória. Merecem, decerto, a nossa estima aqueles outros; eram patriotas. Mas o que se ofereceu a carregar com os pecadores de Israel, o que chorou de alegria quando vi comutada a pena de morte dos seus companheiros, pena que só ia ser executada nele, o enforcado, o esquartejado, o decapitado, esse tem de receber o prêmio na proporção do martírio, e ganhar por todos, visto que pagou por todos. ASSIS, Machado de. Gazeta de Notícias, n. 114, 24 abr. 1892.', 'No processo de transição para a República, a narrativa machadiana sobre a Inconfidência Mineira associa:', 'redenção cristã e cultura cívica.', 'veneração aos santos e radicalismo militar.', 'apologia aos protestantes e culto ufanista.', 'tradição messiânica e tendência regionalista.', 'representação eclesiástica e dogmatismo ideológico.', 'A', '', 1, 7, 1, NULL, 1),
(94, 2016, '', 'O coronelismo era furto de uma alteração nas relações de força entre os proprietários rurais e o governo, e significava o fortalecimento do poder do Estado antes que o predomínio do coronel. Nessa concepção, o coronelismo é, então, um sistema político nacional, com base em barganhas entre o governo e os coronéis. O coronel tem o controle dos cargos públicos, desde o delegado de polícia até a professora primária. O coronel hipoteca seu apoio ao governo, sobretudo na forma de voto. CARVALHO, J. M. Pontos e bordados: escritos de história política. Belo Horizonte: Editora UFMG, 1998 (adaptado).', 'No contexto da Primeira República no Brasil, as relações políticas descritas baseavam-se na', 'coação das milícias locais.', 'estagnação da dinâmica urbana.', 'valorização do proselitismo partidário.', 'disseminação de práticas clientelistas.', 'centralização de decisões administrativas.', 'D', '', 1, 7, 1, NULL, 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(95, 2016, , '', 'A página do periódico do início do século XX documenta um importante elemento da cultura francesa, que é revelador do papel do Brasil na economia mundial, indicado no seguinte aspecto:', 'Prestador de serviços gerais.', 'Exportador de bens industriais.', 'Importador de padrões estéticos.', 'Fornecedor de produtos agrícolas.', 'Formador de padrões de consumo.', 'D', '', 1, 7, 1, NULL, 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(96, 2015, '', 'TEXTO I\r<br>Canudos não se rendeu. Exemplo único em toda a história, resistiu até o esgotamento completo. Vencido palmo a palmo, na precisão integral do termo, caiu no dia 5, ao entardecer, quando caíram os seus últimos defensores, que todos morreram. Eram quatro apenas: um velho, dois homens feitos e uma criança, na frente dos quais rugiam raivosamente cinco mil soldados. CUNHA, E. Os sertões. Rio de Janeiro: Francisco Alves, 1987.\r<br> TEXTO II\r<br>Na trincheira, no centro do reduto, permaneciam quatro fanáticos sobreviventes do extermínio. Era um velho, coxo por ferimento e usando uniforme da Guarda Católica, um rapaz de 16 a 18 anos, um preto alto e magro, e um caboclo. Ao serem intimados para deporem as armas, investiram com enorme fúria. Assim estava terminada e de maneira tão trágica a sanguinosa guerra, que o banditismo e o fanatismo traziam acesa por longos meses, naquele recanto do território nacional. SOARES, H. M. A Guerra de Canudos. Rio de Janeiro: Altina, 1902.', 'Os relatos do último ato da Guerra de Canudos fazem uso de representações que se perpetuariam na memória construída pelo conflito. Nesse sentido, caracterizou a atitude dos sertanejos, respectivamente, como fruto da', 'manipulação e incompetência.', 'ignorância e solidariedade.', 'hesitação e obstinação.', 'esperança e valentia.', 'bravura e loucura.', 'E', '', 1, 7, 1, NULL, 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(97, 2014, , '', 'A charge, datada de 1910, ao retratar a implantação da rede telefônica no Brasil, indica que esta', 'permitiria aos índios se apropriarem da telefonia móvel.', 'ampliaria o contato entre a diversidade de povos indígenas.', 'faria a comunicação sem ruídos entre grupos sociais distintos.', 'restringiria a sua área de atendimento aos estados do norte do país.', 'possibilitaria a integração das diferentes regiões do território nacional.', 'E', '', 1, 7, 1, NULL, 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(98, 2014, '', 'O problema central a ser resolvido pelo Novo Regime era a organização de outro pacto de poder que pudesse substituir o arranja imperial com grau suficiente de estabilidade. O próprio presidente Campos Sales resumiu claramente seu objetivo: “É de lá, dos estados, que se governa a República, por cima das multidões que tumultuam agitadas nas ruas da capital da União. A política dos estados é a política nacional”. CARVALHO, J. M. Os Bestializados: o Rio de Janeiro e a República que não foi. São Paulo: Companhia das Letras, 1987 (adaptado).', 'Nessa citação, o presidente do Brasil no período expressa uma estratégia política no sentido de', 'governar com a adesão popular.', 'atrair o apoio das oligarquias regionais.', 'conferir maior autonomia às prefeituras.', 'democratizar o poder do governo central.', 'ampliar a influência do capital no cenário nacional', '', '', 1, 7, 1, NULL, 1),
(99, 2013, '', 'Nos estados, entretanto, se instalavam as oligarquias, de cujo perigo já nos advertia Saint-Hilaire, e sob o disfarce do que se chamou “a política dos governadores”. Em círculos concêntricos esse sistema vem cumular no próprio poder central que é o sol do nosso sistema. PRADO, P. Retrato do Brasil. Rio de Janeiro: José Olympio, 1972.', 'A crítica presente no texto remete ao acordo que fundamentou o regime republicano brasileiro durante as três primeiras décadas do século XX e fortaleceu o(a)', 'poder militar, enquanto fiador da ordem econômica.', 'presidencialismo, com o objetivo de limitar o poder dos coronéis.', 'domínio de grupos regionais sobre a ordem federativa.', 'intervenção nos estados, autorizada pelas normas constitucionais.', 'isonomia do governo federal no tratamento das disputas locais.', 'C', '', 1, 7, 1, NULL, 1),
(100, 2013, '', 'No final do século XIX, as Grandes Sociedades carnavalescas alcançaram ampla popularidade entre os foliões cariocas. Tais sociedades cultivavam um pretensioso objetivo em relação à comemoração carnavalesca em si mesma: com seus desfiles de carros enfeitados pelas principais ruas da cidade, pretendiam abolir o entrudo (brincadeira que consistia em jogar água nos foliões) e outras práticas difundidas entre a população desde os tempos coloniais, substituindo-os por formas de diversão que consideravam mais civilizadas, inspiradas nos carnavais de Veneza. Contudo, ninguém parecia disposto a abrir mão de suas diversões para assistir ao carnaval das sociedades. O entrudo, na visão dos seus animados praticantes, poderia coexistir perfeitamente com os desfiles. PEREIRA, C. S. Os senhores da alegria: a presença das mulheres nas Grandes Sociedades carnavalescas cariocas em fins do século XIX. In: CUNHA, M. C. P. Carnavais e outras frestas: ensaios de história social da cultura. Campinas: Unicamp; Cecult, 2002 (adaptado).', 'Manifestações culturais como o carnaval também têm sua própria história, sendo constantemente reinventadas ao longo do tempo. A atuação das Grandes Sociedades, descrita no texto, mostra que o carnaval representava um momento em que as', 'distinções sociais eram deixadas de lado em nome da celebração.', 'aspirações cosmopolitas da elite impediam a realização da festa fora dos clubes.', 'liberdades individuais eram extintas pelas regras das autoridades públicas.', 'tradições populares se transformavam em matéria de disputas sociais.', 'perseguições policiais tinham caráter xenófobo por repudiarem tradições estrangeiras.', 'D', '', 1, 7, 1, NULL, 1),
(101, 2011, '', 'Completamente analfabeto, ou quase, sem assistência médica, não lendo jornais, nem revistas, nas quais se limitava a ver figuras, o trabalhador rural, não ser em casos esporádicos, tem o patrão na conta de benfeitor. No plano político, ele luta com o “coronel” e pelo “coronel”. Aí estão os votos de cabresto, que resultam, em grande parte, da nossa organização econômica rural. LEAL, V. N. Coronelismo, enxada e voto. São Paulo: Alfa-Ômega, 1978 (adaptado).', 'O coronelismo, fenômeno político da Primeira República (1889-1930), tinha como uma de suas principais características o controle do voto, o que limitava, portanto, o exercício da cidadania. Nesse período, esta prática estava vinculada a uma estrutura social', 'igualitária, com um nível satisfatório de distribuição da renda.', 'estagnada, com uma relativa harmonia entre as classes.', 'tradicional, com a manutenção da escravidão nos engenhos como forma produtiva típica.', 'ditatorial, perturbada por um constante clima de opressão mantido pelo exército e polícia.', 'agrária, marcada pela concentração da terra e do poder político local e regional.', 'E', '', 1, 7, 1, NULL, 1),
(102, 2011, '', '“Até que ponto, a partir de posturas e interesses diversos, as oligarquias paulista e mineira dominaram a cena política nacional na Primeira República? A união de ambas foi um traço fundamental, mas que não conta toda a história do período. A união foi feita com a preponderância de uma ou de outra das duas frações. Com o tempo, surgiram as discussões e um grande  desacerto final”. FAUSTO, B. História do Brasil. São Paulo: EdUSP, 2004 (adaptado).\r<br>\r<br>“A imagem de um bem-sucedido acordo café com leite entre São Paulo e Minas, um acordo de alternância de presidência entre os dois estados, não passa de uma idealização de um processo muito mais caótico e cheio de conflitos. Profundas divergências políticas colocavam-nos em confronto por causa de diferentes graus de envolvimento no comércio exterior”. TOPIK, S. A presença do estado na economia política do Brasil de 1889 a 1930. Rio de Janeiro: Record, 1989 (adaptado).', 'Para a caracterização do processo político durante a Primeira República, utiliza-se com frequência a expressão Política do Café com Leite. No entanto, os textos apresentam a seguinte ressalva a sua utilização:', 'A riqueza gerada pelo café dava à oligarquia paulista a prerrogativa de indicar os candidatos à presidência, sem necessidade de alianças.', 'As divisões políticas internas de cada estado da federação invalidavam o uso do conceito de aliança entre estados para este período.', 'As disputas políticas do período contradiziam a suposta estabilidade da aliança entre mineiros e paulistas.', 'A centralização do poder no executivo federal impedia a formação de uma aliança duradoura entre as oligarquias.', 'A diversificação da produção e preocupação com o mercado interno unificavam os interesses das oligarquias', 'C', '', 1, 7, 1, NULL, 1),
(103, 2011, '', 'É difícil encontrar um texto sobre a Proclamação da República no Brasil que não cite a afirmação de Aristides Lobo, no Diário Popular de São Paulo, de que “o povo assistiu àquilo bestializado”. Essa versão foi relida pelos enaltecedores da Revolução de 1930, que não descuidaram da forma republicana, mas realçaram a exclusão social, o militarismo e o estrangeirismo da fórmula implantada em 1889. Isto porque o Brasil brasileiro teria nascido em 1930. MELLO, M. T. C. A república consentida. (adaptado).', 'O texto defende que a consolidação de uma determinada memória sobre a Proclamação da República no Brasil teve, na Revolução de 1930, um de seus momentos mais importantes. Os defensores da Revolução de 1930 procuraram construir uma visão negativa para os eventos de 1889, porque esta era uma maneira de', 'valorizar as propostas políticas democráticas e liberais vitoriosas.', 'resgatar simbolicamente as figuras políticas ligadas à Monarquia.', 'criticar a política educacional adotada durante a República Velha.', 'legitimar a ordem política inaugurada com a chegada desse grupo ao poder.', 'destacar a ampla participação popular obtida no processo da Proclamação.', 'D', '', 1, 7, 1, NULL, 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(104, 2011, , '', 'A imagem representa as manifestações nas ruas da cidade do Rio de Janeiro, na primeira década do século XX, que integraram a Revolta da Vacina. Considerando o contexto político-social da época, essa revolta revela', 'a insatisfação da população com os benefícios de uma modernização urbana autoritária.', 'a consciência da população pobre sobre a necessidade de vacinação para a erradicação das epidemias.', 'a garantia do processo democrático instaurado com a República, através da defesa da liberdade de expressão da população.', 'o planejamento do governo republicano na área de saúde, que abrangia a população em geral.', 'o apoio ao governo republicano pela atitude de vacinar toda a população em vez de privilegiar a elite.', 'A', '', 1, 7, 1, NULL, 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(105, 2010, '', 'A serraria construía ramais ferroviários que adentravam as grandes matas, onde grandes locomotivas com guindastes e correntes gigantescas de mais de 100 metros arrastavam, para as composições de trem, as toras que jaziam abatidas por equipes de trabalhadores que anteriormente passavam pelo local. Quando o guindaste arrastava as grandes toras em direção à composição de trem, os ervais nativos que existiam em meio às matas eram destruídos por este deslocamento. MACHADO P. P. Lideranças do Contestado. Campinas: Unicamp. 2004 (adaptado).', 'No início do século XX, uma série de empreendimentos capitalistas chegou à região do meio-oeste de Santa Catarina – ferrovias, serrarias e projetos de colonização. Os impactos sociais gerados por esse processo estão na origem da chamada Guerra do Contestado. Entre tais impactos, encontrava-se', 'a absorção dos trabalhadores rurais como trabalhadores da serraria, resultando em um processo de êxodo rural.', 'o desemprego gerado pela introdução das novas máquinas, que diminuíam a necessidade de mão de obra.', 'a desorganização da economia tradicional, que sustentava os posseiros e os trabalhadores rurais da região.', 'a diminuição do poder dos grandes coronéis da região, que passavam disputar o poder político com os novos agentes.', 'o crescimento dos conflitos entre os operários empregados nesses empreendimentos e os seus proprietários, ligados ao capital internacional.', 'C', '', 1, 7, 1, NULL, 1),
(106, 2010, '', 'As secas e o apelo econômico da borracha — produto que no final do século XIX alcançava preços altos nos mercados internacionais — motivaram a movimentação de massas humanas oriundas do Nordeste do Brasil para o Acre. Entretanto, até o início do século XX, essa região pertencia à Bolívia, embora a maioria da sua população fosse brasileira e não obedecesse à autoridade boliviana.\r<br>\r<br>Para reagir à presença de brasileiros, o governo de La Paz negociou o arrendamento da região a uma entidade internacional, o Bolivian Syndicate, iniciando violentas disputas dos dois lados da fronteira. O conflito só terminou em 1903, com a assinatura do Tratado de Petrópolis, pelo qual o Brasil comprou o território por 2 milhões de libras esterlinas. DISPONÍVEL em: www.mre.gov.br. Acesso em: 03 nov. 2008 (adaptado)', 'Compreendendo o contexto em que ocorreram os fatos apresentados, o Acre tornou-se parte do território nacional brasileiro', 'pela formalização do Tratado de Petrópolis, que indenizava o Brasil pela sua anexação.', 'por meio do auxílio do Bolivian Syndicate aos emigrantes brasileiros na região.', 'devido à crescente emigração de brasileiros que exploravam os seringais.', 'em função da presença de inúmeros imigrantes estrangeiros na região.', 'pela indenização que os emigrantes brasileiros pagaram à Bolívia.', 'C', '', 1, 7, 1, NULL, 1),
(107, 2010, '', 'As ruínas do povoado de Canudos, no sertão norte da Bahia, além de significativas para a identidade cultural, dessa região, são úteis às investigações sobre a Guerra de Canudos e o modo de vida dos antigos revoltosos.', 'Essas ruínas foram reconhecidas como patrimônio cultural material pelo Iphan (Instituto do Patrimônio Histórico e Artístico Nacional) porque reúnem um conjunto de', 'objetos arqueológicos e paisagísticos.', 'acervos museológicos e bibliográficos.', 'núcleos urbanos e etnográficos', 'práticas e representações de uma sociedade.', 'expressões e técnicas de uma sociedade extinta.', 'A', '', 1, 7, 1, NULL, 1),
(108, 2010, '', 'I — Para consolidar-se como governo, a República precisava eliminar as arestas, conciliar-se com o passado monarquista, incorporar distintas vertentes do republicanismo. Tiradentes não deveria ser visto como herói republicano radical, mas sim como herói cívico-religioso, como mártir, integrador, portador da imagem do povo inteiro.\r<br>CARVALHO, J. M. C. A formação das almas: O imaginário da República no Brasil. São Paulo: Companhia das Letras, 1990\r<br>\r<br>I — Ei-lo, o gigante da praça, / O Cristo da multidão!\r<br>\r<br>É Tiradentes quem passa / Deixem passar o Titão.\r<br>\r<br>ALVES, C. Gonzaga ou a revolução de Minas. In: CARVALHO, J. M. C. A formação das almas. O imaginário da República no Brasil. São Paulo: Companhia das Letras, 1990.', 'A 1ª República brasileira, nos seus primórdios, precisava constituir uma figura heroica capaz de congregar diferenças e sustentar simbolicamente o novo regime. Optando pela figura de Tiradentes, deixou de lado figuras como Frei Caneca ou Bento Gonçalves. A transformação do inconfidente em herói nacional evidencia que o esforço de construção de um simbolismo por parte da República estava relacionado', 'ao caráter nacionalista e republicano da Inconfidência, evidenciado nas ideias e na atuação de Tiradentes.', 'à identificação da Conjuração Mineira como o movimento precursor do positivismo brasileiro.', 'ao fato de a proclamação da República ter sido um movimento de poucas raízes populares, que precisava de legitimação.', 'à semelhança física entre Tiradentes e Jesus, que proporcionaria, a um povo católico como o brasileiro, uma fácil identificação.', 'ao fato de Frei Caneca e Bento Gonçalves terem liderado movimentos separatistas no Nordeste e no Sul do país.', 'C', '', 1, 7, 1, NULL, 1),
(109, 2010, '', 'O artigo 402 do Código penal Brasileiro de 1890 dizia: Fazer nas ruas e praças públicas exercícios de agilidade e destreza corporal, conhecidos pela denominação de capoeiragem: andar em correrias, com armas ou instrumentos capazes de produzir uma lesão corporal, provocando tumulto ou desordens.\r<br>\r<br>Pena: Prisão de dois a seis meses.\r<br>\r<br>SOARES, C. E. L. A Negregada instituição: os capoeiras no Rio de Janeiro: 1850-1890. Rio de Janeiro: Secretaria Municipal de Cultura, 1994 (adaptado).', 'O artigo do primeiro Código Penal Republicano naturaliza medidas socialmente excludentes. Nesse contexto, tal regulamento expressava', 'a manutenção de parte da legislação do Império com vistas ao controle da criminalidade urbana.', 'a defesa do retorno do cativeiro e escravidão pelos primeiros governos do período republicano.', 'o caráter disciplinador de uma sociedade industrializada, desejosa de um equilíbrio entre progresso e civilização.', 'a criminalização de práticas culturais e a persistência de valores que vinculavam certos grupos ao passado de escravidão.', 'o poder do regime escravista, que mantinha os negros como categoria social inferior, discriminada e segregada.', 'D', '', 1, 7, 1, NULL, 1),
(110, 2009, '', 'A definição de eleitor foi tema de artigos nas Constituições brasileiras de 1891 e de 1934. Diz a Constituição da República dos Estados Unidos do Brasil de 1891:\r<br>          Art. 70. São eleitores os cidadãos maiores de 21 anos que se alistarem na forma da lei.\r<br>\r<br>A Constituição da República dos Estados Unidos do Brasil de 1934, por sua vez, estabelece que:\r<br>          Art. 180. São eleitores os brasileiros de um e de outro sexo, maiores de 18 anos, que se alistarem na forma da lei.', 'Ao se comparar os dois artigos, no que diz respeito ao gênero dos eleitores, depreende-se que', 'a Constituição de 1934 avançou ao reduzir a idade mínima para votar.', 'a Constituição de 1891, ao se referir a cidadãos, referia-se também às mulheres.', 'os textos de ambas as Cartas permitiam que qualquer cidadão fosse eleitor.', 'o texto da carta de 1891 já permitia o voto feminino.', 'a Constituição de 1891 considerava eleitores apenas indivíduos do sexo masculino.', 'E', '', 1, 7, 1, NULL, 1),
(111, 2018, '', 'Em julho de 1917, convocou-se, em São Paulo, uma greve geral, com adesão de 45.000 trabalhadores, para pedir aumento salarial. A greve se estendeu ao Rio de Janeiro e levou o governo a reforçar o aparato repressivo e decretar estado de sítio em 1918. Nos anos de 1917-1919, o Chile registrou o recrudescimento da agitação sindical. Mobilizavam-se com facilidade 100.000 trabalhadores, como durante as manifestações contra o custo dos alimentos em 1918 e 1919. A Argentina foi outro país que teve um movimento sindical poderoso. Entre 1917 e 1921, o movimento sindical conheceu seu apogeu. Apenas durante o ano de 1919, registraram-se 367 greves na capital Buenos Aires. (Adaptado de Olivier Dabène, América Latina no século XX. Porto Alegre: EDIPUCRS, 2003, p. 64-65.)', 'Considerando o texto acima e seus conhecimentos sobre o tema, assinale a alternativa correta.', 'Os movimentos grevistas foram espontâneos e apartidários nos anos de 1910, rejeitando a infiltração ideológica das lideranças sindicais, de maioria marxista e comunista, pouco mobilizadoras no período.', 'Os movimentos sindicais estavam em processo de fortalecimento, entre outras razões, pela intensa ruralização dos países latino-americanos na década de 1900.', 'O processo de fortalecimento dos movimentos sindicais enfrentou um forte aparato repressivo, nos anos de 1920, marcado pela colaboração entre os Estados latino-americanos.', 'Os movimentos sindicais latino-americanos apresentavam, em 1917, especificidades em relação aos da Europa quanto às pautas reivindicatórias dos trabalhadores.', '', 'D', '', 2, 7, 1, NULL, 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(112, 2017, , 'Compare as duas ilustrações de Angelo Agostini (1843- 1910) sobre o reconhecimento da República brasileira pela Argentina (fig.1) e pela França (fig.2).', 'Assinale a alternativa correta:', 'As alegorias expressam visões diferentes sobre o imaginário da República brasileira: na primeira ela é representada com um olhar de proximidade, e, na segunda o olhar expressa admiração, remetendo à visão corrente do gravurista sobre as relações entre Brasil, França e Argentina.', 'O reconhecimento da França traz a confraternização entre dois países com tradições políticas muito diferentes, porém unidos pelo constitucionalismo monárquico e posteriormente pelo ideário republicano.', 'No reconhecimento da Argentina ao regime republicano brasileiro, as duas repúblicas ocupam a mesma posição, indicando ter a mesma idade de fundação do regime e a similaridade de suas histórias de passado colonial ibérico.', 'As duas imagens usam a figura feminina para representar as três repúblicas, característica não usual para a representação artística do ideário republicano, protagonizado por lideranças masculinas.', '', 'A', '', 2, 7, 1, NULL, 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(113, 2016, '', ' “O Rio civiliza-se!” eis a exclamação que irrompe de todos os peitos cariocas. Temos a Avenida Central, a Avenida Beira Mar (os nossos Campos Elíseos), estátuas em toda a parte, cafés e confeitarias (...), um assassinato por dia, um escândalo por semana, cartomantes, médiuns, automóveis, autobus, autores dramáticos, grandmonde, demi-monde, enfim todos os apetrechos das grandes capitais.\r<br>(“O Chat Noir”, em for-hon/ N° 41, 1907. Extraido de www.objdigital.bn.br/acervo_digitaI/div_periodicos/fonfon/london1907.)', 'A partir do excerto, que se refere ao período da Belle Epoque no Brasil, no início do século XX, é correto afirmar que:', 'O Rio de Janeiro procurava apagar aspectos da época do Império e impulsionar a cultura francesa, renegada por D. Pedro II.', 'A cidade expressava as contradições de um processo de transformações urbanas, sociais e politicas nas primeiras décadas da República.', 'Os costumes franceses eram elementos incorporados pela sociedade carioca como sinônimo da modernização republicana obtida pelo tenentismo.', 'A modernização representou um processo de exclusão social e cultural, patrocinado pelo governo francês, que financiava obras públicas e impunha os produtos franceses à população brasileira.', '', 'B', '', 2, 7, 1, NULL, 1),
(114, 2011, '', 'A denominação de república oligárquica é frequentemente atribuída aos primeiros 40 anos da República no Brasil. Coronelismo, oligarquia e política dos governadores fazem parte do vocabulário político necessário ao entendimento desse período. (Adaptado de Maria Efigênia Lage de Resende, “O processo político na Primeira República e o liberalismo oligárquico”, em Jorge Ferreira e Lucilia de Almeida Neves Delgado (orgs.), O tempo do liberalismo excludente – da Proclamação da República à Revolução de 1930. Rio de Janeiro: Civilização Brasileira, 2006, p. 91.)', 'Relacionando os termos do enunciado, a chamada “república oligárquica” pode ser explicada da seguinte maneira:', 'Os governadores representavam as oligarquias estaduais e controlavam as eleições, realizadas com voto aberto. Isso sustentava a República da Espada, na qual vários coronéis governaram o país, retribuindo o apoio político dos governadores.', 'Diante das revoltas populares do período, que ameaçavam as oligarquias estaduais, os governadores se aliaram aos coronéis, para que chefiassem as expedições militares contra as revoltas, garantindo a ordem, em troca de maior poder político.', 'As oligarquias estaduais se aliavam aos coronéis, que detinham o poder político nos municípios, e estes fraudavam as eleições. Assim, os governadores elegiam candidatos que apoiariam o presidente da República, e este retribuía com recursos aos estados.', 'Os governadores excluídos da política do “café com leite” se aliaram às oligarquias nordestinas, a fim de superar São Paulo e Minas Gerais. Essas alianças favoreceram uma série de revoltas chefiadas por coronéis, que comandavam bandos de jagunços', '', 'C', '', 2, 7, 1, NULL, 1),
(115, 2019, '', 'O cineasta Orlando Senna conta a experiência de ver a primeira exibição do filme Deus e o Diabo na Terra do Sol de Glauber Rocha em 1964: “era uma plateia pequena e nós vimos pela primeira vez, pronto, o Deus e o Diabo na Terra do Sol, e foi aquele impacto pra vida inteira. Eu me lembro que quando o filme terminou de ser exibido, foi um silêncio enorme. Teve um silêncio, e depois de um tempo enorme, toda essa plateia chorando.” (Adaptado do filme O Guarani. Direção de Cláudio Marques e Marília Hughes. Salvador, 2008.)', 'A partir do relato acima e de seus conhecimentos históricos, responda às questões.', 'O filme de Glauber Rocha trata da figura do sertanejo, privilegiando o messianismo. Cite e explique dois elementos fundamentais do messianismo no Nordeste brasileiro entre as décadas de 1890 e 1930.', 'O depoimento registra o impacto produzido pelo filme em sua primeira exibição, no dia 17 de março de 1964. Explique o significado cultural e político do Cinema Novo no Brasil dos anos 60. ', '', 'Elementos do messianismo no Nordeste do Brasil na Primeira República que poderiam ser citados e explicados: a época foi marcada pela existência de líderes carismáticos como Antônio Conselheiro e Padre Cícero, que atraíam seguidores por meio de um discurso religioso ou profético; os movimentos messiânicos tinham um caráter eminentemente rural, relacionado à falta de terras e à pobreza proveniente da crise econômica e política; atraíam camadas populares com promessas de um reino ou um tempo futuro de abundância; opunham-se aos poderes constituídos, fossem o governo central ou o coronelismo e os potentados locais; traziam a ideia de salvação religiosa, pautando-se na promessa de um governo de Deus e não dos homens; representavam uma reação à República recém-instaurada (como é o caso de Canudos) ou retaliações aos potentados locais (como em Juazeiro). Poderia ainda ser apontada e explicada a forma como esses movimentos foram tratados pelos poderes públicos e religiosos, com retaliações e r', 'O Cinema Novo pode ser descrito como um movimento que inaugurou uma nova estética para o cinema brasileiro. Do ponto de vista cultural, buscou recorrentemente retratar a realidade, a pobreza e as desigualdades sociais no Brasil; foi o primeiro movimento cinematográfico nacional com reconhecimento internacional, obtendo várias premiações internacionais; formou um grupo de cineastas jovens que tinham como modelo a produção com “uma câmara na mão”; constituiu uma reação aos formatos anteriores como a chanchada e produções hollywoodianas. Já no campo político, o Cinema Novo constituiu-se como uma reação à ditadura civil-militar, sendo elemento de impasse para o sistema político, especialmente no que se referia à censura imposta por ele em âmbito nacional, em contraposição ao sucesso e às premiações conquistadas em âmbito internacional. Poderia ainda ser citada sua conexão com o PCB e o Centro Popular de Cultura.', '', NULL, 3, 7, 2, NULL, 1),
(116, 2018, '', 'No dia seguinte ao decreto da Libertação, negros e negras deixaram apressadamente os lugares onde tinham vivido durante longo tempo nas humilhações da escravidão e, das fazendas e sítios, afluíram em direção às cidades próximas. A maior parte desses novos cidadãos livres tinha pequenas economias. Ora, seu primeiro ato foi correr às lojas de calçados. (Adaptado de Louis Albert Gaffre, Visions du Brésil. Rio de Janeiro: Francisco Alves, 1912, p. 205. Disponível em: https://archive.org/details/visionsdubrsil00gaff. Acessado em 01/08/2017.)', '', 'Considerando o depoimento citado, explique um significado social do uso do sapato na época.', 'Nomeie duas estratégias de sobrevivência dos brancos pobres, mestiços e forros no período do pós-abolição.', '', 'Na primeira alternativa, o candidato deveria identificar o uso do sapato como um privilégio de indivíduos livres. Nesse sentido, o sapato apresentava-se como um demarcador de hierarquia e ascensão social, mas também representava, de forma material, o acesso à liberdade, o que explica o ato de “correr às lojas de sapato” verificado pelo viajante francês.', 'Muitas eram as estratégias de sobrevivência da população pobre no pós-abolição. Dentre elas o candidato poderia citar: a mobilidade espacial, com deslocamentos em busca de colocação em espaços urbanos e rurais; a adesão a movimentos messiânicos ou de acesso à terra; a realização de pequenos trabalhos, formais e informais; o ingresso nas Forças Armadas; as associações das mais variadas origens como as mutualistas, religiosas (de matriz africana e católicas), identitárias (como grupos de jongo); as moradias coletivas como os cortiços e estalagens.', '', NULL, 3, 7, 2, NULL, 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(117, 2012, , 'A população brasileira, segundo o censo de 1920, era de 30.635.605 habitantes. O número de votantes, entretanto, era restrito, conforme a tabela abaixo:', '', 'Indique duas práticas políticas existentes durante a Primeira República (1889-1930). ', 'Cite duas mudanças que ampliaram o eleitorado brasileiro após a Primeira República.', '', 'Dentre as práticas políticas da Primeira República que poderiam ser citadas, destacam-se as fraudes eleitorais, o voto de cabresto, o coronelismo, a Política de Governadores, a participação política restrita da população nos processos eleitorais. ', 'A ampliação do eleitorado após a Primeira República ocorreu em diferentes momentos, contemplando o direito de voto às mulheres, aos analfabetos, aos clérigos, aos militares, e a redução da idade mínima para 16 anos (facultativo) e 18 anos (obrigatório).', '', NULL, 3, 7, 2, NULL, 1);
INSERT INTO `questoes` (`id`, `ano`, `imagem`, `enunciado`, `pergunta`, `alternativa_a`, `alternativa_b`, `alternativa_c`, `alternativa_d`, `alternativa_e`, `alternativa_certa`, `explicacao`, `id_vestibular`, `id_sub_tema`, `tipo`, `especial`, `id_materia`) VALUES
(142, 2019, '', 'A soberania dos cidadãos dotados de plenos direitos era imprescindível para a existência da cidade-estado. Segundo os regimes políticos, a proporção desses cidadãos em relação à população total dos homens livres podia variar muito, sendo bastante pequena nas aristocracias e oligarquias e maior nas democracias. CARDOSO, C. F. A cidade-estado clássica. São Paulo: Ática, 1985.', 'Nas cidades-estado da Antiguidade Clássica, a proporção de cidadãos descrita no texto é explicada pela adoção do seguinte critério para a participação política:', 'Controle da terra.', 'Liberdade de culto.', 'Igualdade de gênero.', 'Exclusão dos militares.', 'Exigência da alfabetização', 'A', '', 1, 44, 1, NULL, 1);

